(17, 'Ác Quỷ Ma Sơ 2', '100 phút', NULL, 'ac-quy-ma-so-2', 'The Nun 2 - Ác Quỷ Ma Sơ 2 là phần phim tiếp nối câu chuyện năm 2019 của The Nun, phim lấy bối cảnh nước Pháp năm 1956.', 1, 'ac-quy-ma-so-ii-thumb9573.avif', 5, 'phimle', 1, 2, 1, 0, 'EVIL DEMONS 2', 0, 1, NULL, '2023-12-15 20:57:21', '2022', 'ÁC QUỶ MA SƠ 2, ac-quy-ma-so-2', 2, 'Ppnu3iUAm5U', '1', 4648, 'Michael Chaves', 'Taissa Farmiga, Jonas Bloquet, Storm Reid, Anna Popplewell, Bonnie Aarons, Katelyn Rose Downey, Suzanne Bertish, Léontine d\'Oncieu, Anouk Darwin Homewood, Peter Hudson', 66),
(18, 'Gen V', '55 phút / tập', NULL, 'gen-v', 'Tại trường đại học duy nhất dành cho siêu anh hùng ở Mỹ, những sinh viên tài năng đặt ra những ranh giới đạo đức để kiểm tra, cạnh tranh để giành thứ hạng cao nhất của trường đại học và có cơ hội gia nhập đội siêu anh hùng ưu tú của The Seven, Vought International. Khi những bí mật đen tối của trường được đưa ra ánh sáng, họ phải quyết định xem mình muốn trở thành loại anh hùng nào.', 1, 'Gen V161.jpg', 4, 'phimbo', 1, 2, 1, 0, 'GEN V', 0, 0, NULL, '2023-12-15 20:57:17', '2023', 'GEN V,  gen-v', 2, 'owwH-Bn9t-w', '8', 2254, 'Đang cập nhật', 'Jaz Sinclair, Chance Perdomo, Lizze Broadway, Shelley Conn, Maddie Phillips, London Thor, Derek Luh, Asa Germann, Patrick Schwarzenegger, Sean Patrick Thomas', 48),
(19, 'Người Lính', '120 phút', NULL, 'nguoi-linh', '1 Chiến binh mang trong mình dòng máu của 1 Người lính, thực hiện các vụ cướp táo bạo chỉ để mang lại lợi ích cho đất nước cho tới khi những sự thật bị chôn vùi dần dần hé lộ...', 1, 'nguoi-linh-thumb2071.avif', 5, 'phimle', 1, 2, 1, 0, 'SOLDIERS', 0, 0, NULL, '2023-12-15 20:57:13', '2000', '1 Chiến binh mang trong mình dòng máu của 1 Người lính', 1, 'C69H2hvU5HU', '1', 4101, 'Paul W. S. Anderson', 'Kurt Russell, Jason Scott Lee, Jason Isaacs, Connie Nielsen, Sean Pertwee, Gary Busey, Michael Chiklis, Sara Paxton, K.K. Dodds, James Black', 65),
(21, 'Thế Giới Hoàn Mỹ', '20 phút / tập', NULL, 'the-gioi-hoan-my', 'Thế Giới Hoàn Mỹ\r\n\r\nBộ phim Thế Giới Hoàn Mỹ cải biên từ tiểu thuyết cùng tên.\r\nHắn vì tu đạo mà sinh, vì ứng kiếp mà đến, hắn hoá thân thành muôn vàn huyết vũ, vẩy xuống vạn cổ tuế nguyệt, trải qua vô số tôi luyện của thời không và gột rửa của dòng chảy tháng năm, hắn hoá thành vạn cổ, hoá thành tự tại.\r\nXem nam chính Thạch Hạo làm thế nào đạt đến huy hoàng đỉnh cao một đời, tạo nên truyền thuyết vô tận.\r\n\r\nCảnh giới tu luyện:\r\nPhàm Nhân:\r\nBàn Huyết Cảnh -> Động Thiên Cảnh -> Hóa Linh Cảnh -> Minh Văn Cảnh -> Liệt Trận Cảnh -> Tôn Giả Cảnh.\r\n\r\nThần Đạo:\r\nThần Hỏa Cảnh -> Chân Nhất Cảnh -> Thánh Tế Cảnh -> Thiên Thần Cảnh -> Hư Đạo Cảnh -> Trảm Ngã Cảnh -> Độn Nhất Cảnh -> Chí Tôn Cảnh -> Chí Tôn Cực Đạo.\r\n\r\nTiên Đạo:\r\nChân Tiên -> Tiên Vương -> Chuẩn Tiên Đế -> Tiên Đế.', 1, 'thegioihoanmy1842.jpg', 4, 'phimbo', 1, 3, 1, 0, 'Perfect World', 1, 1, '2023-11-16 23:42:35', '2023-12-15 20:57:09', '2021', 'THẾ GIỚI HOÀN MỸ, the-gioi-hoan-my', 1, 'fAo_EzEPZIg', '49', 169, NULL, NULL, 47),
(29, 'Nữ Khổng Lồ Xanh', '60 phút / tập', NULL, 'nu-khong-lo-xanh', 'Jennifer Walters điều hướng cuộc sống phức tạp của một luật sư 30 tuổi độc thân, đồng thời cũng là một Hulk siêu mạnh 6 feet 7 inch màu xanh lá cây.', 1, '62fe542f61f8e (1)499.jpg', 4, 'phimbo', 9, 2, 1, 0, 'She-Hulk: Attorney at Law', 0, 0, '2023-12-03 14:52:49', '2023-12-15 20:57:05', '2022', 'Nữ Khổng Lồ Xanh (Phần 1) - She-Hulk: Attorney at Law (Season 1), She-Hulk: Attorney at Law (Season 1) 2022 Season 1', 0, 'AnvgTbERbRw', '9', 33005, 'Jessica Gao', 'Tatiana Maslany, Mark Ruffalo, Tim Roth, Benedict Wong, Ginger Gonzaga', 60),
(30, 'Bố Già', '128 Phút', NULL, 'bo-gia', 'Câu chuyện về Ba Sang - con thứ hai trong 4 anh em ồn ào: Giàu, Sang, Phú, Quý. Ba Sang là một người ga lăng, “quá” tốt bụng và luôn hy sinh vì người khác dù họ có muốn hay không. Quân - Ba Sang’s son là một Youtuber trẻ hiện đại.', 1, 'bo-gia-2021-thumb5014.jpg', 2, 'phimle', 9, 1, 1, 2, 'Dad, I\'m Sorry', 0, 0, '2023-12-06 14:57:18', '2023-12-15 20:56:03', '2021', 'BỐ GIÀ', 1, 'PDp4Ic8ZGUM', '1', 3033, 'Trấn Thành, Vũ Ngọc Đãng', 'Trấn Thành, Tuấn Trần, Ngân Chi, Ngọc Giàu, Lê Giang', 25),
(32, 'Ngôi Đền Kỳ Quái 3', '114 phút', NULL, 'ngoi-den-ky-quai-3', 'Sau thành công của ngôi đền kỳ quái 2 phần Pee Nak 3 này nói về Aod, một người thầy tu trẻ tuổi ở Đền Thamma Nakanimitr, đã khai quật được một chiếc vòng chân cổ bằng vàng từ một ngôi mộ. Anh ta quyết định bỏ túi chiếc vòng chân và sau đó trở thành \"con mồi\" của một lời nguyền biến da của anh ta thành vảy rắn. Lời nguyền đánh thức hồn ma của một tu sĩ là nạn nhân đầu tiên của lời nguyền, và anh ta muốn chiếc vòng chân của mình trở lại, vì anh ta đã bị lời nguyền tra tấn. Aod và những người bạn của mình bắt tay vào hành trình tìm cách chữa khỏi lời nguyền ở vùng Đông Bắc Thái Lan và sông Mekong. Hồn ma của Nak Kam theo sau họ khi họ chạy đua với thời gian để cứu Aod trước khi anh ta chết.', 1, 'ngoi-den-ky-quai-3-thumb547.avif', 2, 'phimle', 9, 6, 1, 0, 'Pee Nak 3', 0, 3, '2023-12-06 15:18:46', '2023-12-15 20:56:11', '2022', 'NGÔI ĐỀN KỲ QUÁI 3, Pee Nak 3', 0, 'wNgkxBJlBIY', '1', 555, 'Phontharis Chotkijsadarsopon', 'Bhuripat Vejvongsatechavat, Witthawat Rattanaboonbaramee, Phiravich Attachitsataporn, Pond Khunnapat Pichetworawut, Chanagtien Potongkam', 24),
(33, 'Ngôi Đền Kỳ Quái 1', '108 phút', NULL, 'ngoi-den-ky-quai-1', 'Bộ ba lạ thường đến ngôi đền ở nơi hẻo lánh để xuất gia. Nhưng họ sẽ phải đối mặt với một hồn ma giận dữ nếu muốn trở thành nhà sư – hay muốn sống.', 1, 'ngoi-den-ky-quai-thumb7673.avif', 2, 'phimle', 9, 6, 1, 0, 'Pee Nak 1', 0, 1, '2023-12-06 15:22:09', '2023-12-15 20:56:23', '2019', 'NGÔI ĐỀN KỲ QUÁI 1, Pee Nak 1', 2, 'Jr9fXN74ivE', '1', 544, 'Phontharis Chotkijsadarsopon', 'Vachiravit Paisarnkulwong, Chinawut Indracusin, Witthawat Rattanaboonbaramee', 23),
(34, 'Ngôi Đền Kỳ Quái 2', '114 phút', NULL, 'ngoi-den-ky-quai-2', 'First và Balloon hoàn tục để về với cuộc sống bình thường nhưng sớm quay lại ngôi đền khi một linh hồn mới bắt đầu khủng bố họ.', 1, 'ngoi-den-ky-quai-2-thumb4216.avif', 2, 'phimle', 9, 6, 1, 0, 'Pee Nak 2', 0, 2, '2023-12-06 15:26:08', '2023-12-15 20:56:28', '2020', 'NGÔI ĐỀN KỲ QUÁI 2,  Pee Nak 2', 2, 'lHI6gSlBCZ4', '1', 3703, 'Phontharis Chotkijsadarsopon', 'Vachiravit Paisarnkulwong, Witthawat Rattanaboonbaramee, Bhuripat Vejvongsatechavat', 21),
(35, 'Godzilla X Kong: Đế Chế Mới', NULL, NULL, 'godzilla-x-kong-de-che-moi', 'Sau trận đấu bùng nổ, Godzilla và Kong phải đoàn tụ chống lại một mối đe dọa khổng lồ chưa được khám phá ẩn giấu trong thế giới của chúng ta, thách thức chính sự tồn tại của họ – và của chính chúng ta.', 1, 'godzilla-x-kong-de-che-moi-thumb6835.avif', 1, 'phimle', 1, 2, 1, 5, 'Godzilla x Kong: The New Empire', 0, 0, '2023-12-07 14:42:30', '2023-12-15 20:56:34', '2024', 'GODZILLA X KONG: ĐẾ CHẾ MỚI, godzilla-x-kong-de-che-moi', 0, 'FzdPg_cbxUI', '1', 1367, 'Adam Wingard', 'Rebecca Hall, Brian Tyree Henry, Dan Stevens, Kaylee Hottle, Alex Ferns, Fala Chen, Rachel House, Mercy Cornwall', 5),
(36, 'Godzilla Đại Chiến Kong', '115 phút', NULL, 'godzilla-dai-chien-kong', 'Chương tiếp theo của EPIC trong Monsterverse điện ảnh hố hai trong số các biểu tượng lớn nhất trong lịch sử hình ảnh chuyển động với nhau - Godzilla đáng sợ và người Kông hùng vĩ - với nhân loại bị cuốn vào sự cân bằng.', 1, 'godzilla-dai-chien-kong-thumb2224.avif', 2, 'phimle', 1, 2, 1, 0, 'Godzilla vs. Kong', 0, 0, '2023-12-07 15:37:10', '2023-12-15 20:56:38', '2021', 'GODZILLA ĐẠI CHIẾN KONG, godzilla-dai-chien-kong', 2, 'odM92ap8_c0', '1', 5039, 'Adam Wingard', NULL, 22),
(37, 'Cô Đi Mà Lấy Chồng Tôi', '80 phút / tập', NULL, 'co-di-ma-lay-chong-toi', 'Khi Ji-won, một bệnh nhân ung thư 37 tuổi, bước vào gặp chồng và cũng là bạn thân của cô, cô nhận ra cả cuộc đời mình chỉ là một lời nói dối. Tệ hơn nữa, cô lại chết một cách bi thảm dưới tay chồng mình. Liệu mọi chuyện có khác đi nếu cô ấy đưa ra những lựa chọn khác? May mắn thay cho Ji-won, cô có cơ hội viết lại số phận của mình khi được tái sinh thành bản thân lúc trẻ. Lần này, cô thề sẽ sống một cuộc sống hạnh phúc. Nhưng trước hết là sự trả thù. Kế hoạch của cô ấy? Để gả người bạn thân cũ của mình cho người chồng dối trá, lừa dối của mình.', 1, 'co-di-ma-lay-chong-toi-thumb6627.avif', 4, 'phimbo', 1, 11, 1, 5, 'Marry My Husband', 0, 1, '2023-12-07 22:14:09', '2023-12-15 20:56:43', '2024', 'CÔ ĐI MÀ LẤY CHỒNG TÔI, co-di-ma-lay-chong-toi', NULL, '8pojKoIi2U4', '16', 636, 'Park Won-gook', 'Park Min-young, Na In-woo, Lee Yi-kyung, Song Ha-yoon, Lee Gi-kwang, Gong Min-jeung, Kwon BoA', 59),
(38, 'Thất Hình Đại Tội: Tứ Kỵ Sĩ Khải Huyền', '24 phút / tập', NULL, 'that-hinh-dai-toi-tu-ky-si-khai-huyen', 'Khi lời tiên tri về ngày diệt vong xuất hiện trên vùng đất Britannia yên bình, một cậu bé có trái tim thuần khiết bắt đầu cuộc hành trình khám phá — và trả thù.', 1, 'that-hinh-dai-toi-tu-ky-si-khai-huyen-thumb5771.avif', 4, 'phimbo', 1, 7, 1, 5, 'The Seven Deadly Sins: Four Knights of the Apocalypse', 0, 0, '2023-12-07 22:18:04', '2023-12-15 20:56:53', '2023', 'THẤT HÌNH ĐẠI TỘI: TỨ KỴ SĨ KHẢI HUYỀN, that-hinh-dai-toi-tu-ky-si-khai-huyen', NULL, 'TEleYPV4-5I', '24', 2377, 'Đang cập nhật', 'Shou Komura, Aino Shimada, Kanna Nakamura, Kikunosuke Toya, Koki Uchiyama, Rikiya Koyama, Sachi Kokuryu, Toshiyuki Morikawa', 58),
(39, 'Tôi Là Cơn Thịnh Nộ', '89 Phút', NULL, 'toi-la-con-thinh-no', 'Một giáo phái cổ xưa bị lôi kéo vào hoạt động buôn bán máu nham hiểm đã phạm phải sai lầm chết người khi bắt cóc một phụ nữ trẻ có quá khứ bạo lực và gây sốc.', 1, 'toi-la-con-thinh-no-thumb1452.avif', 1, 'phimle', 3, 2, 1, 5, 'I Am Rage', 0, 0, '2023-12-07 22:20:27', '2023-12-15 20:56:58', '2023', 'TÔI LÀ CƠN THỊNH NỘ,  toi-la-con-thinh-no', NULL, 'Kg6rCrx4gcs', '1', 4334, 'David Ryan Keith', 'Hannaj Bang Bendz, Marta Svetek, Derek Nelson, Antonia Whillans, Jamie B. Chambers, Luke Aquilina', 1),
(40, 'Fallout', '90 phút', NULL, 'fallout', 'Câu chuyện về những thứ có và không có trong một thế giới mà hầu như không còn gì để có. 200 năm sau ngày tận thế, những cư dân hiền lành của những nơi trú ẩn bụi phóng xạ sang trọng buộc phải quay trở lại địa ngục bị chiếu xạ mà tổ tiên của họ để lại - và bị sốc khi khám phá ra một vũ trụ vô cùng phức tạp, vui vẻ kỳ lạ và cực kỳ bạo lực đang chờ đợi họ.', 1, 'fallout-thumb2721.avif', 1, 'phimle', 1, 2, 1, 5, 'Fallout', 0, 0, '2023-12-07 22:23:56', '2023-12-15 20:57:01', '2024', 'FALLOUT', NULL, '0kQ8i2FpRDk', '1', 5739, NULL, 'Walton Goggins, Ella Purnell, Kyle MacLachlan, Xelia Mendes-Jones, Aaron Moten', 7),
(41, 'Quý Cô Mạng Nhện', NULL, NULL, 'quy-co-mang-nhen', 'Sau khi sống sót sau một vụ tai nạn, nhân viên y tế Cassandra Webb bắt đầu phát triển khả năng thấu thị. Buộc phải đối mặt với những tiết lộ về quá khứ của mình, cô xây dựng mối quan hệ với ba phụ nữ trẻ có định mệnh hướng tới tương lai đầy quyền lực...nếu tất cả họ có thể sống sót qua hiện tại chết chóc.', 1, 'quy-co-mang-nhen-thumb3678.avif', 1, 'phimle', 1, 2, 1, 5, 'Madame Web', 0, 0, '2023-12-07 22:28:04', '2023-12-15 20:55:57', '2024', 'QUÝ CÔ MẠNG NHỆN, quy-co-mang-nhen', NULL, 'uNM5ntLLvEE', '1', 1675, 'S.J. Clarkson', 'Dakota Johnson, Sydney Sweeney, Celeste O\'Connor, Isabela Merced, Tahar Rahim, Mike Epps, Emma Roberts, Adam Scott, Zosia Mamet', 3),
(42, 'Quái Vật Đen', '100 Phút', NULL, 'quai-vat-den', 'Quái Vật Đen xoay quanh câu chuyện khi kỳ nghỉ bình dị của gia đình Oilman Paul Sturges biến thành cơn ác mộng. Bởi họ đã gặp phải một con cá mập Megalodon hung dữ, không từ bất kỳ khoảnh khắc nào để bảo vệ lãnh thổ của mình. Bị mắc kẹt và tấn công liên tục, Paul và gia đình của mình phải tìm cách để an toàn sống sót trở về bờ trước khi con cá mập khát máu này tấn công lần nữa.', 1, 'quai-vat-den-thumb4995.avif', 5, 'phimle', 1, 2, 1, 0, 'The Black Demon', 0, 0, '2023-12-07 22:36:46', '2023-12-15 20:55:50', '2023', 'QUÁI VẬT ĐEN,  The Black Demon', NULL, '-Q8lGHrer3g', '1', 2584, 'Adrian Grünberg', 'Josh Lucas, Fernanda Urrejola, Julio Cedillo, Venus Ariel, Carlos Solórzano, Jorge A. Jimenez, Raúl Méndez, Héctor Jiménez, Edgar Flores, Omar Chaparro', 64),
(44, 'Con Đường Âm Dương', '26phút', NULL, 'con-duong-am-duong', 'Để bắt được ba kẻ thủ mưu giết thịt người, một nhóm cảnh sát hợp tác với một nhà nghiên cứu bệnh học pháp y, người có thể nhận ra những giây lát rốt cuộc của nạn nhân trước khi chết.', 1, 'con-duong-am-duong-thumb3830.avif', 3, 'phimle', 1, 3, 1, 0, 'Demons Path', 1, 0, '2023-12-07 23:18:41', '2023-12-15 20:55:45', '2018', 'CON ĐƯỜNG ÂM DƯƠNG,  con-duong-am-duong', 2, NULL, '1', 17, NULL, 'Sunny Lau, Kate Yeung, Chiêm Thụy Văn, Ngải Uy', 34),
(45, 'Ai Chết Giơ Tay: Pháp Sư Mù', '121 Phút', NULL, 'ai-chet-gio-tay-phap-su-mu', 'Bỗng dưng bị mù một cách bí ẩn, pháp sư Tinh Lâm bắt đầu hành trình biến đổi để khôi phục thị lực và khám phá ý nghĩa thực sự của cuộc đời.', 1, 'ai-chet-gio-tay-phap-su-mu-thumb1076.avif', 2, 'phimle', 9, 1, 1, 0, 'Land Of Spirits: The Blind Shaman', 0, 0, '2023-12-08 23:13:19', '2023-12-15 20:55:41', '2019', 'AI CHẾT GIƠ TAY: PHÁP SƯ MÙ,  ai-chet-gio-tay-phap-su-mu', 2, 'KbRjegsahXw', '1', 2965, 'Lý Minh Thắng', 'Huỳnh Lập, Đại Nghĩa, Việt Hương, Khả Như, Quang Trung, Hạnh Thảo, Ngọc Giàu, Phương Thanh, Lê Giang', 26),
(58, 'Ai Chết Giơ Tay: Kẻ Độc Hành', '40 phút/tập', NULL, 'ai-chet-gio-tay-ke-doc-hanh', 'Sinh ra trong gia đình làm nghề trừ tà, vị pháp sư nghiệp dư nọ sử dụng chuyên môn của mình để bắt ma ở khu phố ngập tràn hoạt động siêu nhiên.', 1, 'ai-chet-gio-tay-ke-doc-hanh-thumb8776.avif', 4, 'phimbo', 9, 1, 1, 0, 'Land of Spirits: The Young Shaman', 0, 0, '2023-12-12 13:33:42', '2023-12-15 20:55:35', '2022', 'AI CHẾT GIƠ TAY: KẺ ĐỘC HÀNH,  ai-chet-gio-tay-ke-doc-hanh', 0, 'AOMyaLjUJOQ', '8', 2944, 'Lý Minh Thắng', 'Huỳnh Lập, Quốc Khánh, Puka, Hồng Vân, Duy Anh, Hứa Minh Đạt, Lâm Vỹ Dạ, Vy Vân', 49),
(59, 'Thế Chiến Ii: Lời Kể Từ Tiền Tuyến', '47 phút/tập', NULL, 'the-chien-ii-loi-ke-tu-tien-tuyen', 'Thông qua các thước phim tư liệu được nâng tầm đầy sống động và chia sẻ từ mọi phía của cuộc xung đột, loạt phim tài liệu này giúp Thế chiến II trở nên sống động hơn bao giờ hết.', 1, 'https://img.ophim9.cc/uploads/movies/the-chien-ii-loi-ke-tu-tien-tuyen-thumb.jpg', 4, 'phimbo', 1, 12, 1, 0, 'World War II: From the Frontlines', 0, 0, '2023-12-12 13:59:10', '2023-12-15 20:55:30', '2023', 'Thế chiến II: Lời kể từ tiền tuyến, the-chien-ii-loi-ke-tu-tien-tuyen', 0, NULL, '6', 3711, 'Rob Coldstream', 'John Boyega', 61),
(62, 'Spy X Family (Phần 2)', '24 phút/tập', NULL, 'spy-x-family-phan-2', 'Nhằm ngăn những kẻ cực đoan châm ngòi cho cuộc chiến với quốc gia láng giềng Ostania, Twilight, điệp viên hàng đầu của Westalis phải điều tra chính trị gia người Ostanian là Donovan Desmond bằng cách xâm nhập vào trường học của con trai ông ta - học viện Eden danh giá. Dưới vỏ bọc Loid Forger, một bác sĩ, Twilight đã nhận nuôi cô bé mồ côi Anya và kết hôn giả với Yor Briar rồi cho Anya nhập học tại học viện Eden mà không hề hay biết hai người này cũng có thân phận bí mật: Yor là sát thủ được mệnh danh \"Công chúa Thorn\" còn Anya là siêu năng lực gia có khả năng đọc suy nghĩ. Tuy khởi đầu là một gia đình giả mà cả ba đều lợi dụng lẫn nhau, nhưng theo thời gian, họ dần nhận ra tầm quan trọng của hai người kia trong trái tim mình.', 1, 'https://img.ophim9.cc/uploads/movies/spy-x-family-phan-2-thumb.jpg', 4, 'phimbo', 9, 7, 1, 0, 'SPY x FAMILY', 0, 0, '2023-12-12 15:48:24', '2023-12-15 20:55:19', '2023', 'SPY x FAMILY (Phần 2), spy-x-family-phan-2', 1, 'gb6MEGUWbh0', '13', 3621, NULL, 'Takuya Eguchi, Atsumi Tanezaki, Saori Hayami', 57),
(63, 'Đảo Hải Tặc', '25 phút/tập', NULL, 'dao-hai-tac', 'Monkey D. Luffy, 1 cậu bé rất thích Đảo hải tặc có ước mơ tìm được kho báu One Piece và trở thành Vua hải tặc - Pirate King. Lúc nhỏ, Luffy tình cờ ăn phải trái quỉ (Devil Fruit) Gomu Gomu, nó cho cơ thể cậu khả năng co dãn đàn hồi như cao su nhưng đổi lại cậu sẽ không bao giờ biết bơi. Sau đó Luffy lại được Shank cứu thoát tuy nhiên ông ta bị mất 1 cánh tay. Sau đấy Shank chia tay Luffy và để lại cho cậu cái mũ rơm (Straw Hat) và nói rằng: Sau này bao giờ thành cướp biển hãy gặp ta và trả lại nó. Chính lời nói này đã thúc đầy Luffy trở thành 1 cướp biển thật sự.Hãy cùng theo dõi xem liệu Luffy có thể trở thành đạt được kho báu One Piece và trở thành Vua Hải Tặc không nhé.', 1, 'https://img.ophim9.cc/uploads/movies/one-piece-thumb.jpg', 4, 'phimbo', 9, 7, 1, 2, 'One Piece (Luffy)', 0, 0, '2023-12-12 15:59:17', '2023-12-15 20:55:25', '1999', 'Đảo Hải Tặc, one-piece', 1, 'vUSunPAO-nw', '?', 5332, 'Takashi Otsuka', 'Mayumi Tanaka, Kazuya Nakai, Akemi Okamura, Kappei Yamaguchi, Hiroaki Hirata', 56),
(64, 'Chú Thuật Hồi Chiến 2', '24 phút/tập', NULL, 'chu-thuat-hoi-chien-2', 'Yuuji Itadori, một học sinh trung học, dành cả ngày để tham gia một cách thụ động vào các hoạt động huyền bí giả mạo với Câu lạc bộ Huyền bí ở phòng câu lạc bộ hoặc bệnh viện nơi cậu đến thăm ông nội đang ốm của mình. Lối sống thanh bình của anh nhanh chóng trở nên kỳ lạ khi anh tình cờ phát hiện ra một cổ vật bị nguyền rủa. Một ngón tay của quỷ Sukuna Ryoumen, Vua của những lời nguyền, được cho là đã bị anh nuốt vào khi ăn. Đột nhiên bị đẩy vào vương quốc đáng sợ của Lời nguyền—những sinh vật được tạo ra từ lòng căm thù và sự tiêu cực của con người—Yuuji thấy mình bị mắc kẹt ở đó.\r\nBây giờ chúng ta hãy tiếp tục theo dõi mùa thứ hai!', 1, 'https://img.ophim9.cc/uploads/movies/chu-thuat-hoi-chien-2-thumb.jpg', 4, 'phimbo', 5, 7, 1, 0, 'Jujutsu Kaisen 2 || Sorcery Fight 2', 0, 0, '2023-12-14 16:17:59', '2023-12-15 20:55:15', '2023', 'Chú Thuật Hồi Chiến 2, chu-thuat-hoi-chien-2', 0, NULL, '23', 4281, NULL, NULL, 55),
(65, 'Búp Bê Ro-Bot', '75 phút', NULL, 'bup-be-ro-bot', 'Búp bê ro-bot-The Robot (2017) [HD-Vietsub]', 1, 'https://img.ophim9.cc/uploads/movies/bup-be-ro-bot-thumb.jpg', 5, 'phimle', 1, 3, 1, 0, 'The Robot', 0, 0, '2023-12-14 16:43:16', '2023-12-15 21:00:48', '2017', 'Búp bê ro-bot, bup-be-ro-bot', NULL, NULL, '1', 1810, 'He Jia Nan', 'Lạc Minh Cật, Ma Yue Tong, Liu Nan Xi', 63),
(67, 'Kung Fu Panda 4', '? Phút', NULL, 'kung-fu-panda-4', 'Po đang chuẩn bị trở thành thủ lĩnh tinh thần của Thung lũng Hòa bình của mình, nhưng cũng cần một người thay thế anh ấy làm Chiến binh Rồng. Vì vậy, anh ta sẽ huấn luyện một học viên kung fu mới tại chỗ và sẽ chạm trán với một nhân vật phản diện tên là Tắc kè hoa, kẻ gợi lên những nhân vật phản diện trong quá khứ.', 1, 'https://img.ophim9.cc/uploads/movies/kung-fu-panda-4-thumb.jpg', 2, 'phimle', 1, 2, 1, 5, 'Kung Fu Panda 4', 0, 0, '2023-12-16 13:50:05', '2023-12-16 13:51:11', '2024', 'Kung Fu Panda 4, kung-fu-panda-4', NULL, 'https://www.youtube.com/watch?v=_inKs4eeHiI', '1', 6639, 'Mike Mitchell', 'Jack Black, Awkwafina, Viola Davis, Bryan Cranston, Ke Huy Quan, Dustin Hoffman, Ian McShane, James Hong, Angelina Jolie, Jackie Chan', 20),
(68, 'Trạng Quỳnh', '93 phút', NULL, 'trang-quynh', 'Chàng trai thông minh, lắm trò ma mãnh nỗ lực giải oan cho người thầy yêu quý của mình khỏi lời luận tội đáng ngại liên quan đến một gã quan liêu gian xảo.', 1, 'https://img.ophim9.cc/uploads/movies/trang-quynh-thumb.jpg', 2, 'phimle', 9, 1, 1, 0, 'Trang Quynh', 0, 0, '2023-12-16 13:51:37', '2023-12-16 13:52:53', '2019', 'Trạng Quỳnh, trang-quynh', 2, NULL, '1', 92, NULL, 'Quốc Anh, Nhã Phương, Trấn Thành', 19),
(69, 'Trái Tim Rồng 3: Lời Nguyền Của Phù Thủy', '97 phút', NULL, 'trai-tim-rong-3-loi-nguyen-cua-phu-thuy', 'Khi một hiệp sĩ nhiệt huyết vô tình chạm trán một con rồng, cả hai tạo ra một liên minh lạ thường trong trận chiến cam go với một pháp sư hiểm ác.', 1, 'https://img.ophim9.cc/uploads/movies/trai-tim-rong-3-loi-nguyen-cua-phu-thuy-thumb.jpg', 5, 'phimle', 5, 2, 1, 0, 'Dragonheart 3: The Sorcerer\'s Curse', 0, 0, '2023-12-16 13:56:07', '2023-12-16 13:58:04', '2015', 'Trái tim rồng 3: Lời nguyền của phù thủy, trai-tim-rong-3-loi-nguyen-cua-phu-thuy', 2, NULL, '1', 2666, NULL, 'Julian Morris, Tamzin Merchant, Ben Kingsley', 62),
(70, 'Thiếu Niên Minh Long', '44 phút/tập', NULL, 'thieu-nien-minh-long', 'Nhằm phát huy tối đa tiềm năng của học sinh, Trường THPT Thực Nghiệm Minh Long, một ngôi trường tư thục tại thành phố Tinh Châu, đã thành lập lớp 12-11 do thầy giáo tiếng Anh xuất sắc Lôi Minh và cô giáo tâm lý Tang Hạ dẫn dắt. Lý Nhiên là một học sinh cấp 3 bình thường tại Trường THPT Minh Long. Từ nhỏ cậu đã mồ côi cha mẹ, vẫn luôn sống nương tựa cùng bà nội. Dù ốm yếu bệnh tật, bà nội vẫn chăm chỉ làm việc kiếm tiền, nhất quyết bắt cậu thi đại học để thực hiện giấc mộng robot của mình. Nhằm chữa bệnh cho bà, người cháu hiếu thảo Lý Nhiên có ý định bỏ học để kiếm tiền phụ giúp gia đình. Lôi Minh không bỏ mặc bất kỳ học sinh nào, cố gắng hết sức để ngăn Lý Nhiên bỏ học, đưa những học sinh có hoàn cảnh khó khăn như cậu và Trình Vũ Sam vào lớp 12-11. Để giúp học sinh thắp sáng lại ước mơ, Lôi Minh và Tang Hạ lần lượt bồi dưỡng cả trên phương diện giáo dục và tâm lý, tiến hành đào tạo theo năng lực, hướng dẫn học sinh hình thành thói quen học tập tốt. Họ giúp đỡ từng học sinh đối mặt với khó khăn, cải thiện quan hệ gia đình, đồng thời xây dựng thái độ lạc quan, từ đó giành được sự yêu mến và tin tưởng của học trò. Sau cùng, đám học trò Lý Nhiên đã nỗ lực hết mình và thi đỗ vào các trường đại học hằng mơ ước, bắt đầu hành trình mới trong cuộc đời. ', 1, 'https://img.ophim9.cc/uploads/movies/thieu-nien-minh-long-thumb.jpg', 1, 'phimbo', 1, 3, 1, 0, 'The Hope', 0, 0, '2023-12-16 13:58:53', '2023-12-16 14:05:18', '2023', 'Thiếu Niên Minh Long, thieu-nien-minh-long', NULL, NULL, '30', 1248, NULL, NULL, 15),
(71, 'Kung Fu Panda: Hiệp Sĩ Rồng (Phần 3)', '24 phút/tập', NULL, 'kung-fu-panda-hiep-si-rong-phan-3', 'Trong hành trình gấp rút phá hủy vĩnh viễn vũ khí Tianshang toàn năng, các Hiệp Sĩ Rồng đối đầu với những kẻ thù vừa quen thuộc vừa không ngờ tới.', 1, 'kung-fu-panda-hiep-si-rong-phan-3-thumb3182.avif', 4, 'phimbo', 1, 2, 1, 0, 'Kung Fu Panda: The Dragon Knight (Season 3)', 0, 0, '2023-12-16 16:29:24', '2023-12-16 16:29:42', '2022', 'Kung Fu Panda: The Dragon Knight (Season 3), KUNG FU PANDA: HIỆP SĨ RỒNG (PHẦN 3)', 1, NULL, '19', 2227, NULL, 'Jack Black, Rita Ora, James Hong, Chris Geere, Amy Hill, Nolan North, Della Saba', 54),
(72, 'Kẻ Ẩn Danh', '97 Phút', NULL, 'ke-an-danh', 'Lâm - một người đàn ông từng là xã hội đen nhưng lại mất trí nhớ và nay đang lẩn trốn như một người bình thường, kiếm sống bằng lao động chân tay. Lâm sống cùng vợ - Hạnh và con gái riêng của cô là Hiền. Hiền vẫn chưa chấp nhận tình yêu thương của chú Lâm dành cho mình. Hiền lớn lên với sự bốc đồng và bị dụ dỗ bởi Tiến - một thanh niên đạo đức giả chuyên dụ dỗ những cô gái vào nhà thổ để trở thành gái mại dâm. Xuyên suốt bộ phim là hành trình đi tìm con gái của Lâm', 1, 'ke-an-danh-thumb7117.avif', 1, 'phimle', 1, 1, 1, 0, 'Bad Blood', 0, 0, '2023-12-16 17:04:19', '2023-12-16 17:04:45', '2023', 'KẺ ẨN DANH, ke-an-danh', NULL, '9yVmRrrxoOc', '1', 2676, 'Dan Trong Tran', 'Kiều Minh Tuấn, Mạc Văn Khoa, Quốc Trường', 14),
(73, 'Tây Hành Kỷ (Phần 4)', '20phút/tập', NULL, 'tay-hanh-ky-phan-4', 'Tây Hành Kỷ Chi Trùng Sinh Thiên kể về Đại pháp sư Đường Tam Tạng cùng các đồ đệ đi đến bên kia để trả ngọn lửa sáng thế, bảo vệ thế giới. Trong phần này, Ngao Tuyết về đội, tiểu đội Tây Hành gặp phải trắc trở mới, thầy trò đồng lòng chống lại Cổ Long và yêu quái vực sâu.', 1, 'tay-hanh-ky-phan-4-thumb3338.avif', 3, 'phimbo', 6, 3, 1, 0, 'The Westward IV', 1, 0, '2023-12-16 17:09:23', '2023-12-16 17:09:27', '2022', 'TÂY HÀNH KỶ (PHẦN 4), tay-hanh-ky-phan-4', NULL, '6vCoYTqysKA', '12', 1446, NULL, NULL, 33),
(74, 'Hùng Long Phong Bá', '30 phút/tập', NULL, 'hung-long-phong-ba', 'Phim xoay quanh hành trình của 4 chàng trai quê gồm Hùng (Tùng Min), Long (Steven Nguyễn), Phong (Võ Đình Hiếu), Bá (Trầm Minh Hoàng) bước chân lên thành phố với đầy tham vọng, nhưng trớ trêu thay cả 4 người bạn đều vô tình vướng vào một cuộc chiến của thế giới ngầm, để rồi đánh mất chính mình cùng tình anh em bao lâu gắn bó.', 1, 'hung-long-phong-ba-thumb9652.avif', 3, 'phimbo', 2, 1, 1, 0, 'Brothers For Life', 1, 0, '2023-12-16 17:16:06', '2023-12-16 17:16:45', '2022', 'HÙNG LONG PHONG BÁ, hung-long-phong-ba', 2, 'Tai_Oa0kwAg', '5', 2103, 'Toni Dương Bảo Anh', 'Tùng Min, Steven Nguyễn, Trầm Minh Hoàng, Võ Đình Hiếu, NSƯT Công Ninh, Tiểu Bảo Quốc, Quách Ngọc Tuyên, Thanh Hoa, Phan Ngân, Vũ Ngọc Anh', 32),
(75, 'Đấu Phá Thương Khung Ova 4: Duyên Khởi', '25 phút/tập', NULL, 'dau-pha-thuong-khung-ova-4-duyen-khoi', 'Đấu Phá Thương Khung OVA 4: Duyên Khởi là tập đặc biệt \'\'Duyên Khởi\'\', duyên từ đâu bắt đầu, lại từ đâu mà kết thúc. Chuyện xưa lật lại, chúng ta lại một lần nữa kể lại câu chuyện Tiêu Viêm bị từ hôn dưới một góc độ khác, cũng là câu chuyện cũ của một nhân vật chính khác.Đây là phần đặc biệt nói về quá khứ của \'\'Dược lão\'\'', 1, 'dau-pha-thuong-khung-ova-4-duyen-khoi-thumb1808.avif', 3, 'phimbo', 1, 3, 1, 0, 'Doupo Cangqiong: Yuanqi', 1, 0, '2023-12-16 17:21:06', '2023-12-16 17:21:15', '2022', 'ĐẤU PHÁ THƯƠNG KHUNG OVA 4: DUYÊN KHỞI, dau-pha-thuong-khung-ova-4-duyen-khoi', NULL, 'Vs0KuIWfYbA', '3', 3731, NULL, NULL, 31),
(77, 'Quyền Vương', '42 phút/tập', NULL, 'quyen-vuong', 'Hải Chính Hy (do Đàm Tuấn Ngạn đóng) là nhà vô địch Muay Thái với liên tiếp 12 lần bất bại. Nhưng sau lần ăn mừng chiến thắng thứ 13, anh vô tình xung đột với một tên xã hội đen khi giải cứu người phụ nữ bị quấy rối, không may qua đời. Khi xem lại đoạn ghi hình các trận đấu của Chính Hy, Hải Chính Lam (do Trương Chấn Lãng đóng) phát hiện cái chết của anh mình có nhiều uẩn khúc. Lam nghi ngờ có liên quan đến huấn luyện viên Thạch Ngạo Sơn (do Lê Diệu Tường đóng).\r\n\r\nLôi Kiên (do Diêu Tử Linh đóng), cô nàng trâm anh luôn cháy bỏng khát khao có một chỗ đứng trong thế giới Muay Thái. Với quyết tâm của mình, Lôi Kiên đã trở thành cố vấn cho liên đoàn quyền anh, từ đó gặp gỡ và nảy sinh mối quan hệ mập mờ với Ngạo Sơn.', 1, 'quyen-vuong-thumb297.avif', 3, 'phimbo', 1, 3, 1, 0, 'The Ringmaster', 1, 0, '2023-12-16 23:20:14', '2023-12-16 23:25:16', '2021', 'QUYỀN VƯƠNG, quyen-vuong', NULL, 'wO4qRMX9Z7Y', '25', 1270, NULL, 'Yiu-Cheung Lai, Shaun Tam Chun-Yin, Owen Cheung', 30),
(78, 'Thuỷ Quái', '80 phút', NULL, 'thuy-quai', 'Thủy Quái kể về một người con trai yếu đuối và nhút nhát. Anh sinh ra trong một gia đình đánh cá và đã nhìn thấy cha mình bị quái vật \" khỉ nước \" giết chết khi anh đi câu cá với cha lúc còn nhỏ, nó đã để lại một nỗi ám ảnh trong tim anh. Mười năm sau, quái vật \"Khỉ nước\" xuất hiện trở lại, giết chết em trai và cha của nữ chính. Để cứu người phụ nữ, nam chính không để những người phụ nữ bị giết làm \"vật hiến tế\". Anh bắt đầu học các kỹ năng câu cá và nước mà cha anh đã dạy cho anh. Anh cũng mời anh em họ của mình để tập luyện và tham gia chiến đấu cùng nhau. Dân làng cũng nhận ra rằng những sai lầm của họ và đã gia nhập đội quái vật dưới nước. Cuối cùng tất cả mọi người đã diệt trừ được những con khỉ nước, dân làng trở lại một cuộc sống bình thường.', 1, 'thuy-quai-thumb3893.avif', 3, 'phimle', 1, 3, 1, 0, 'Water Monster', 1, 0, '2023-12-16 23:26:46', '2023-12-16 23:32:12', '2019', 'THUỶ QUÁI, thuy-quai', NULL, '68ZZz7dkr84', '1', 3932, 'Ngô Ưng Tường', 'Lý Lộ Binh, Phàn Thiếu Hoàng, Trương Đông', 29),
(79, 'Nhện Khổng Lồ 2: Anh Hùng Của Liên Bang', '93 phút', NULL, 'nhen-khong-lo-2-anh-hung-cua-lien-bang', 'Sau khi quân đội Liên Minh đã đánh vào hang ổ của bọn Bọ và bắt được con Bọ chúa đem về Trái Đất. Tuy vậy mầm mống của chúng không hề bị tiêu diệt hết mà bọn chúng càng lúc càng lớn mạnh hơn, với nhiều giống Bọ mới được tạo ra. Chúng đã nhập vào người những người lính bị bỏ rơi ngoài chiến tuyến và lợi dụng họ cho ý đồ xoá sổ loài người của chúng. Nhưng may thay đã xuất hiện một người hùng có khả năng ngoại cảm, có thể thấy trước được tương lai và một sĩ quan dũng cảm...', 1, 'nhen-khong-lo-2-anh-hung-cua-lien-bang-thumb7630.avif', 3, 'phimle', 5, 2, 1, 0, 'Starship Troopers 2: Hero of the Federation', 1, 0, '2023-12-16 23:30:13', '2023-12-16 23:30:23', '2004', 'NHỆN KHỔNG LỒ 2: ANH HÙNG CỦA LIÊN BANG, nhen-khong-lo-2-anh-hung-cua-lien-bang', NULL, 'hsahSjKvJOE', '1', 5228, 'Phil Tippett', 'Billy Brown, Richard Burgi, Kelly Carlson', 28),
(80, 'Xì Trum 2', '107 phút', NULL, 'xi-trum-2', 'Phù thủy Gà-mên tạo ra một nhóm những sinh vật Naughtes, nhằm giúp hắn làm vật thay thế nhóm Xì Trum đầy ma thuật. Nhưng hắn khám phá ra chỉ những Xì trum thật sự mới có thể đáp ứng được hắn và có một câu thần chú bí mật có thể làm những tên Naughties biến thành Xì Trum. Gà-mên bắt cóc Người đẹp Xì trum và đưa cô ấy đến Paris. Đại Xì Trum, Xì trum Hậu Đậu, Xì trum Khó tính, ... gặp lại 2 người bạn Patrick và Grace, đi cứu Người đẹp xì trum.', 1, 'xi-trum-2-thumb9665.avif', 3, 'phimle', 9, 2, 1, 0, 'The Smurfs 2', 1, 0, '2023-12-17 15:34:23', '2023-12-17 15:36:53', '2013', 'XÌ TRUM 2, xi-trum-2, The Smurfs 2', NULL, 'taGJQlsVr6M', '1', 2826, 'Raja Gosnell', 'Neil Patrick Harris, Jayma Mays, Katy Perry', 27),
(81, 'Siêu Sao Siêu Ngố', '88 phút', NULL, 'sieu-sao-sieu-ngo', 'Siêu sao siêu ngố là câu chuyện kể về Thế Sơn (Trường Giang) - một nghệ sĩ nổi tiếng được săn đón nồng nhiệt bậc nhất của showbiz cùng chuyện tình của anh với một cô họa sĩ là Trúc (Sam).\r\nCả hai quen nhau từ thời anh chỉ có hai bàn tay trắng cho đến lúc trở thành một ngôi sao, Trúc luôn là hậu phương vững chắc cho Sơn sau bao mỏi mệt.\r\nĐến một ngày, khi xảy ra những sự cố ngoài ý muốn, Thế Sơn buộc phải chọn lựa giữa tình yêu và sự nghiệp đang thăng tiến của mình.', 1, 'sieu-sao-sieu-ngo-thumb8862.avif', 2, 'phimle', 9, 1, 1, 0, 'Super Star Super Silly', 0, 0, '2023-12-17 15:40:10', '2023-12-17 15:41:24', '2018', 'SIÊU SAO SIÊU NGỐ, Super Star Super Silly, sieu-sao-sieu-ngo', NULL, 'DULpxY1Vspw', '1', 1724, 'Đỗ Đức Thịnh', 'Trường Giang, Nguyễn Hà My, Thanh Thủy', 18),
(82, 'Biệt Đội Marvel', '105 Phút', NULL, 'biet-doi-marvel', 'Carol Danvers, hay còn gọi là Captain Marvel, đã lấy lại danh tính của mình từ Kree độc tài và trả thù Trí tuệ tối cao. Nhưng những hậu quả ngoài ý muốn khiến Carol phải gánh vác gánh nặng của một vũ trụ bất ổn. Khi nhiệm vụ của cô ấy đưa cô ấy đến một hố sâu dị thường có liên quan đến một nhà cách mạng Kree, sức mạnh của cô ấy bị vướng vào sức mạnh của Kamala Khan, một người hâm mộ cuồng nhiệt của Thành phố Jersey, hay còn gọi là Ms. Marvel, và cháu gái bị ghẻ lạnh của Carol, hiện là S.A.B.E.R. phi hành gia thuyền trưởng Monica Rambeau. Cùng với nhau, bộ ba kỳ lạ này phải hợp tác và học cách phối hợp với nhau để cứu vũ trụ.', 1, 'biet-doi-marvel-thumb9952.avif', 2, 'phimle', 1, 2, 1, 3, 'The Marvels', 0, 0, '2023-12-17 15:49:25', '2023-12-17 15:49:55', '2023', 'BIỆT ĐỘI MARVEL, biet-doi-marvel, The Marvels', NULL, 'fDPhEkZWTa8', '1', 75, 'Nia DaCosta', 'Brie Larson, Teyonah Parris, Iman Vellani, Samuel L. Jackson, Zawe Ashton, Park Seo-jun, Lashana Lynch, Shamier Anderson, Mohan Kapur, Zenobia Shroff', 16),
(83, 'Người Nhện: Không Còn Nhà', '140 phút', NULL, 'nguoi-nhen-khong-con-nha', 'Bộ phim tiếp nối sự kiện của phần Spider-man: Far From Home khi phản diện Mysterio đã tiết lộ danh tính thực sự của người nhện là Peter Parker, Spiderman đã phải đối diện với nhiều lời khen chê trái chiều đến từ công chúng, việc này không những làm ảnh hưởng đến cuộc sống của Peter mà còn khiến Dì May, cậu bạn Ned và người yêu MJ bị liên lụy. Vì vậy Peter đã tìm đến Doctor Strange để nhờ ông tìm cách giải quyết chuyện này. Tuy nhiên trong quá trình thi triển thuật đảo ngược thời gian, do nhanh mồm nhanh miệng mà Peter đã khiến việc đọc phép gặp lỗi và mở ra những cánh cửa đưa các tên ác nhân ở các vũ trụ khác đến nơi cậu sinh sống. Liệu rằng Peter có thể sửa chữa được lỗi lầm của mình và điều gì đang chờ đợi cậu ở phía trước? Phim bám sát thuyết đa vũ trụ, cho phép tồn tại các chiều không gian song song. Mang đến trải nghiệm tuyệt vời cho khán giả khi thấy những nhân vật mình yêu thích xuất hiện, từ chính diện cho tới phản diện.', 1, 'nguoi-nhen-khong-con-nha-thumb1273.avif', 5, 'phimle', 1, 2, 1, 4, 'Spider-Man: No Way Home', 0, 0, '2023-12-17 15:58:19', '2023-12-17 15:58:42', '2021', 'NGƯỜI NHỆN: KHÔNG CÒN NHÀ, nguoi-nhen-khong-con-nha, Spider-Man: No Way Home', NULL, 'o4NzWTNqSto', '1', 667, 'Jon Watts', 'Zendaya, Tom Holland, Jon Favreau, Benedict Cumberbatch, Angourie Rice', 77),
(84, 'Tết Ở Làng Địa Ngục', '45 phút/tập', NULL, 'tet-o-lang-dia-nguc', 'Các hậu duệ của một băng cướp khét tiếng điều tra hàng loạt án mạng tàn bạo ở làng của họ. Liệu đây là nghiệp chướng hay \"tác phẩm\" của kẻ báo thù?', 1, 'tet-o-lang-dia-nguc-thumb9870.avif', 1, 'phimbo', 1, 1, 1, 0, 'Hellbound Village', 0, 0, '2023-12-17 16:06:03', '2023-12-17 16:06:08', '2023', 'Hellbound Village, tet-o-lang-dia-nguc', NULL, 'C2V38ghWHlQ', '12', 249, 'Trần Hữu Tấn', 'Quang Tuấn, Phú Đôn, Võ Tấn Phát, Nguyên Thảo, Vân Báu, Huỳnh Như Đan, Ngô Hải Na, Hạnh Thúy, Đình Khang, Ngọc Thư, Lan Phương', 13),
(86, 'Shangri-La Frontier: Thợ Săn Game Rác', '24 phút/tập', NULL, 'shangri-la-frontier', 'Nam sinh cao trung năm hai Rakurou Hizutome chỉ quan tâm đến một chuyện duy nhất là tìm ra \"những trò chơi tồi tệ\" và phá đảo chúng. Kỹ năng chơi game của anh đã trở nên bất bại khi không ai sánh kịp và không còn trò chơi nào đủ tệ để anh có thể thưởng thức. Cho nên, khi được giới thiệu về một game VR mới Shangri-La Frontier, anh đã bước vào game ngay lập tức và bỏ qua cả hướng dẫn mở đầu dành cho tân binh. Nhưng liệu lão làng game thủ \"rank thách đấu\" có thể phá đảo những gì đang tồn tại trong Shangri-La Frontier?', 1, 'https://img.ophim9.cc/uploads/movies/shangri-la-frontier-thumb.jpg', 1, 'phimbo', 1, 7, 1, 0, 'Shangri-La Frontier', 0, 0, '2023-12-17 16:34:12', '2023-12-17 16:34:58', '2023', 'Shangri-La Frontier: Thợ săn game rác, shangri-la-frontier', NULL, '0XmM7YZjPSc', '24', 3174, NULL, 'Yuma Uchida, Azumi Waki, Yoko Hikasa, Makoto Koichi, Rina Hidaka, Akio Otsuka', 12),
(87, 'Công Chúa Ma Cà Rồng Tầm Thường', '24 phút/tập', NULL, 'cong-chua-ma-ca-rong-tam-thuong', '“Hả? Gì cơ?”\r\n\r\nBừng tỉnh khỏi giấc ngủ, Terakomari - một hikikomori bỗng dưng được chỉ định làm chỉ huy, chưa kể quân đoàn do cô chịu trách nhiệm được biết đến là những kẻ đã lật đổ và mưu sát chính cấp trên của mình. Dù được sinh ra trong một gia tộc ma cà rồng danh giá, nhưng cô chẳng thể uống máu, chẳng có khả năng thể chất, cơ thể thì thấp bé so với lứa tuổi, đến cả ma thuật còn không dùng được.\r\n\r\nĐứng trước nỗi tuyệt vọng, cô hầu gái Vill đã ra tay cứu giúp.\r\n\r\n“Komari-sama, cứ để thần lo, thần đảm bảo rằng ngài sẽ không bị phát hiện đâu.”\r\n\r\nBộ truyện fantasy hài hước kể về những cuộc đấu tranh của Komari bắt đầu từ đây. Dù chỉ là một Hikikomori, nhưng nếu cô nàng toàn tâm toàn ý thì sẽ làm nên chuyện chăng?', 1, 'https://img.ophim9.cc/uploads/movies/cong-chua-ma-ca-rong-tam-thuong-thumb.jpg', 1, 'phimbo', 5, 7, 1, 0, 'ひきこまり吸血姫の悶々', 0, 0, '2023-12-17 17:30:42', '2023-12-17 17:32:57', '2023', 'Công Chúa Ma Cà Rồng Tầm Thường, cong-chua-ma-ca-rong-tam-thuong', NULL, NULL, '? tập', 684, NULL, NULL, 11),
(89, 'Vua Sư Tử 3', '77 Phút', NULL, 'vua-su-tu-3', 'Phần này được coi là phần 3 của The Lion King, mặc dù trong phần này sự xuất hiện của Simba không nhiều. Phần này nhắc nhiều đến Timon (người bạn từ thuở thiếu thời của Simba). Anh chàng trên con đường đi tìm \"Vùng đất hứa\" (hay chính xác hơn là \"vùng đất không có việc làm\" - vì Timon làm việc gì cũng hỏng)...', 1, 'vua-su-tu-3-thumb7262.avif', 3, 'phimle', 1, 2, 1, 0, 'The Lion King 1½', 1, 0, '2023-12-17 21:54:31', '2023-12-17 22:01:25', '2004', 'VUA SƯ TỬ 3, vua-su-tu-3, The Lion King 3', NULL, 'p0DTnqn71WQ', '1', 3778, 'Bradley Raymond', 'Nathan Lane, Ernie Sabella, Julie Kavner', 46),
(90, 'Bạn Bè 2', '123 phút', NULL, 'ban-be-2', 'Friend 2 là phần tiếp theo của Friend - bom tấn điện ảnh 2001 do Jang Dong Gun thủ vai chính. Cũng tương tự phần 1, nội dung Friend 2 xoay quanh hoạt động của 1 băng nhóm xã hội đen từng làm mưa làm gió những năm 60 cho tới cuộc sống hiện tại của họ ở 2010. Trong phim, Kim Woo Bin vào vai cậu con trai bí mật của Dong Su - nhân vật do Jang Dong Gun từng thể hiện rất thành công 12 năm về trước.', 1, 'ban-be-2-han-quoc-thumb3745.avif', 3, 'phimle', 5, 11, 1, 0, 'Friend : The Great Legacy', 1, 0, '2023-12-17 22:00:21', '2023-12-17 22:01:29', '2013', 'BẠN BÈ 2, ban-be-2, Friend : The Great Legacy', NULL, 'hd2fixmpuBY', '1', 6942, 'Kyung-Taek Kwak', 'Oh-seong Yu, Jin-mo Ju, Woo-bin Kim', 45),
(91, 'Sứ Mệnh Nội Gián 2', '97 phút', NULL, 'su-menh-noi-gian-2', 'Để bảo vệ nhân chứng và triệt phá đường dây bắt cóc trẻ em nguy hiểm nhất, đội hình cảnh và nội gián HongKong đã vào cuộc và đặt chính sinh mạng của mình vào ván bài. Trắng đen, đúng sai không thể nhận bằng mắt thường? Sau cùng ai mới chính là nội gián?', 1, 'su-menh-noi-gian-2-thumb4779.avif', 3, 'phimle', 2, 14, 1, 0, 'Line Walker 2', 1, 0, '2023-12-17 22:08:00', '2023-12-17 22:14:07', '2019', 'SỨ MỆNH NỘI GIÁN 2, su-menh-noi-gian-2, Line Walker 2', NULL, 'n0wouqHTnmk', '1', 6388, 'Jazz Boon', 'Cổ Thiên Lạc, Trương Gia Huy, Ngô Trấn Vũ', 44),
(92, 'Tội Lỗi', '90 phút', NULL, 'toi-loi', 'Asger Holm là viên cảnh sát trực điện thoại. Hôm ấy anh nhận cuộc gọi khẩn cấp về một người phụ nữ bị bắt có. Khi cuộc gọi đột ngột ngắt kết nối, cuộc tìm kiếm người phụ nữ và kẻ bắt cóc cô bắt đầu. Chỉ duy nhất chiếc điện thoại là công cụ điều tra của mình, Asger Holm bước vào cuộc đua với thời gian để giải cứu người phụ nữ bí ẩn đó. Nhưng có một tội ác lớn hơn rất nhiều so với những gì anh ta nghĩ ban đầu.', 1, 'toi-loi-thumb6217.avif', 3, 'phimle', 2, 15, 1, 0, 'The Guilty', 1, 0, '2023-12-17 22:16:37', '2023-12-17 22:17:00', '2018', 'TỘI LỖI, toi-loi, The Guilty', NULL, 'NaB_ERMAZu4', '1', 3978, 'Gustav Möller', 'Jakob Cedergren, Jessica Dinnage, Omar Shargawi', 43),
(93, 'Vua Bò Cạp 2', '110 phút', NULL, 'vua-bo-cap-2', 'Sau khi chứng kiến tận mắt cái chết của cha dưới tay của tên khát máu Sargon, chàng trai trẻ Mathayus quyết tâm luyện tập tại thung lũng Bò Cạp hòng trả thù cho cha mình. Sau đó, anh phải dấn thân vào một thế giới khác đầy nguy hiểm để có được thanh gươm có thể giết được Sargon. Liệu Mathayus có thể trả thù được cho cha?', 1, 'vua-bo-cap-2-thumb1783.avif', 3, 'phimle', 1, 2, 1, 0, 'The Scorpion King 2: Rise of a Warrior', 1, 0, '2023-12-17 22:19:48', '2023-12-17 22:20:34', '2008', 'VUA BÒ CẠP 2, The Scorpion King 2: Rise of a Warrior, vua-bo-cap-2', 2, 'sD_4J21e92M', '1', 2212, 'Russell Mulcahy', 'Michael Copon, Karen David, Simon Quarterman', 42),
(94, 'Diệp Vấn 3: Trận Chiến Cuối Cùng', '104 phút', NULL, 'diep-van-3-tran-chien-cuoi-cung', 'Diệp Vấn 3 - Ip Man 3 là phần cuối cùng trong series phim \"Diệp Vấn\". Phim tiếp tục xoay quanh cuộc sống của võ sư Diệp Vấn trong khoảng thời gian khó khăn nhất: phải mở võ đường kiếm sống, chống chọi với những tên lính Nhật cùng những trận đấu võ đài sinh tử. Ở phần này, phim khắc họa nhiều hơn tình yêu vợ chồng, cha con cũng như những cuộc chiến xuất phát từ đời thường, trong đó phải kể tới màn giao đấu giữa 2 đệ tử Vịnh Xuân nhưng theo 2 sư phụ khác nhau.', 1, 'diep-van-3-thumb1370.avif', 3, 'phimle', 5, 3, 1, 0, 'Ip Man 3', 1, 0, '2023-12-17 22:22:30', '2023-12-19 20:33:08', '2015', 'DIỆP VẤN 3: TRẬN CHIẾN CUỐI CÙNG, diep-van-3-tran-chien-cuoi-cung, Ip Man 3', NULL, '_6it8ra_jxQ', '1', 3094, 'Wilson Yip', 'Donnie Yen, Mike Tyson', 41),
(95, 'Thợ Săn', '91 phút', NULL, 'tho-san', 'Thợ Săn là một bộ phim điện ảnh phiêu lưu do Mỹ sản xuất được đạo diễn Nisha Ganatra phụ trách. Nôi dung phim xoay quanh một giáo sư khảo cổ học tình cờ phát hiện manh mối về một lăng mộ bí mật nằm sâu trong lòng đất, ông cho rằng đây có thể là lăng mộ của vị vua bí ẩn của Ai Cập chôn cùng hàng ngàn kho báu quý giá. Một chuyến phiêu lưu đến Ai Cập bắt đầu cùng những tân sinh viên của vị giáo sư này.', 1, 'tho-san-thumb4495.avif', 3, 'phimle', 5, 2, 1, 0, 'The Hunters', 1, 0, '2023-12-17 22:25:17', '2023-12-17 22:26:20', '2013', 'THỢ SĂN, tho-san, The Hunters', NULL, 'S8ShMRhXYeM', '1', 1347, 'Nisha Ganatra', 'Robbie Amell, Alexa PenaVega, Victor Garber', 40),
(96, 'Vụ Ám Sát Ngược Thời Gian', '110 phút', NULL, 'vu-am-sat-nguoc-thoi-gian', 'Bộ phim Vụ Ám Sát Ngược Thời Gian - Assassin 33 A.D. kể về câu chuyện khi đang nghiên cứu, một nhóm thiên tài trẻ tuổi vô tình, tình cờ phát hiện ra một âm mưu khủng bố bí mật nhằm tạo ra cỗ máy thời gian để quay ngược thời gian và thay đổi lịch sử.', 1, 'vu-am-sat-nguoc-thoi-gian-thumb3682.avif', 3, 'phimle', 5, 2, 1, 0, 'Assassin 33 A.D.', 1, 0, '2023-12-17 22:28:41', '2023-12-17 22:35:22', '2020', 'VỤ ÁM SÁT NGƯỢC THỜI GIAN, vu-am-sat-nguoc-thoi-gian, Assassin 33 A.D.', NULL, 'SPYWWAwbVic', '1', 668, 'Jim Carroll', 'Donny Boaz, Ilsa Levine, Morgan Roberts', 39),
(97, 'Lời Nhắn Của Sát Thủ', '89 phút', NULL, 'loi-nhan-cua-sat-thu', 'Message Man lấy bối cảnh vẻ đẹp của quần đảo Indonesia. Câu chuyện kể về một cựu sát thủ ẩn dật, Ryan Teller (Paul O\'Brien). Chọn sống một cuộc sống du mục trên thuyền của mình, Ryan hình thành một tình bạn bất đắc dĩ với một cậu bé địa phương Doni (Aji Santosa) và gia đình. Khi cậu bé gần như bị giết, bắt đầu một trả thù dữ dội buộc Ryan phải thiết lập lại các mối quan hệ và cũng đối mặt với quá khứ đen tối của mình.', 1, 'loi-nhan-cua-sat-thu-thumb6362.avif', 3, 'phimle', 1, 2, 1, 0, 'Message Man', 1, 0, '2023-12-17 22:30:57', '2023-12-17 22:35:35', '2018', 'LỜI NHẮN CỦA SÁT THỦ, loi-nhan-cua-sat-thu, Message Man', NULL, '3FxPi1Suy_c', '1', 3001, NULL, NULL, 38),
(98, 'Mộ Rồng', '92 phút', NULL, 'mo-rong', 'Câu chuyện kể về một nhóm người gồm Travis Preston và bạn bè cùng nhau đi đến Trung Quốc để chứng thực sự tồn tại của một loài động vật bí ẩn. Trong Hành trình đó, Travis và đồng đội đã phải trải qua nhiều nguy hiểm để bảo vệ sinh vật bí hiểm này trước tham vọng săn giết của một nhóm kẻ thù khác. Chuyện gì sẽ xảy ra với Travis và đồng đội? Sinh vật kia thật sự là gì?', 1, 'mo-rong-thumb2457.avif', 3, 'phimle', 5, 2, 1, 0, 'Legendary: Tomb of The Dragon', 1, 0, '2023-12-17 22:32:47', '2023-12-17 22:35:30', '2011', 'MỘ RỒNG, mo-rong, Legendary: Tomb of The Dragon', NULL, 'pzR2MDLtF1c', '1', 476, NULL, 'Dolph Lundgren, Scott Adkins', 37),
