(101, 'Máu Và Cổ Vật (Phần 2)', '40 phút/tập', NULL, 'mau-va-co-vat-phan-2', 'Một chuyên gia về cổ vật hợp tác với một tên trộm nghệ thuật để truy bắt kẻ khủng bố tài trợ cho các cuộc tấn công của hắn bằng cách sử dụng các hiện vật bị đánh cắp.', 1, 'https://img.ophim9.cc/uploads/movies/mau-va-co-vat-phan-2-thumb.jpg', 4, 'phimbo', 1, 2, 1, 0, 'Blood & Treasure (Season 2)', 0, 0, '2023-12-17 22:39:52', '2023-12-17 22:42:56', '2022', 'Máu và Cổ Vật (Phần 2), mau-va-co-vat-phan-2', 2, '9TQqDSwRuzk', '13', 3687, NULL, 'Matt Barr, Sofia Pernas, James Callis, Michael James Shaw, Mark Gagliardi, Michelle Lee', 53),
(102, 'Lính Đánh Thuê 2', '64 phút', NULL, 'linh-danh-thue-2', 'Lính đánh thuê 2, linh-danh-thue-2', 1, 'https://img.ophim9.cc/uploads/movies/linh-danh-thue-2-thumb.jpg', 5, 'phimle', 2, 3, 1, 0, 'Mercenary War 2', 0, 0, '2023-12-17 22:43:59', '2023-12-17 22:46:22', '2018', 'Lính đánh thuê 2, linh-danh-thue-2', NULL, 'WF8Drc9qbaI', '1', 5634, 'Zhen Yu Fei', 'Eric, Shi Yu Qing, Ba Sa, Li Qiao Dan, Zhang Ci', 76),
(103, 'Đấu Phá Thương Khung: Thức Tỉnh', '93 Phút', NULL, 'dau-pha-thuong-khung-thuc-tinh', 'Tiêu Viêm (Mã Bá Khiên đóng) là con trai thứ ba của một trong ba gia tộc lớn nhất thành Ô Thản, vì đấu khí không cao mà trở thành trò cười của mọi người. Khi bị đại đệ tử của Vân Lam Tông là Nạp Lan Yên Nhiên (Cận Dương Dương đóng) hủy hôn, Tiêu Viêm không chịu được sự sỉ nhục đã lập ra giao hẹn ba năm với Yên Nhiên, ba năm sau sẽ tỷ thí để quyết định hôn ước. Để nâng cao đấu khí, Tiêu Viêm đã đến rặng núi ma thú, kết bạn với Tiểu Y Tiên (Từ Y đóng), nhưng rồi cũng bị vướng vào trận tranh chấp của binh đoàn Đầu Sói. Khi trốn chạy sự truy đuổi của binh đoàn Đầu Sói, Tiêu Viêm đã vô tình bắt gặp Đấu hoàng Vân Chi (Hồ Tĩnh đóng) và Dực sư vương Tử Tinh đang giao đấu với nhau. Vân Chi không thể đánh bại Dực sư, Tiêu Viêm đã cứu Vân Chi. Sau một vài biến cố, hai người quyết định đi thách đấu Dực sư một lần nữa. Hai người chia nhau ra hành động, sau cùng giành thắng lợi. Vân Chi âm thầm rời đi, Tiêu Viêm cũng quyết định rời khỏi rặng núi ma thú, hướng đến sa mạc của Xà tộc.... ', 1, 'https://img.ophim9.cc/uploads/movies/dau-pha-thuong-khung-thuc-tinh-thumb.jpg', 5, 'phimle', 1, 3, 1, 0, 'Fights Break Sphere', 0, 0, '2023-12-17 22:47:49', '2023-12-17 22:48:39', '2023', 'Đấu Phá Thương Khung: Thức Tỉnh, dau-pha-thuong-khung-thuc-tinh', NULL, '_4Da-g1rRXk', '1', 3412, 'Zhao Xiaoding', 'Victor Ma, Li Jiuxiao, Zhang Hanyu, Jiang Wu, Gao Shuguang, Jing Hu, Wen Huang, Jiang Zhuojun, Nita Lei, Jin Yangyang', 75),
(104, 'Biệt Đội Diệt Vong (Phần 4)', '49 phút/tập', NULL, 'biet-doi-diet-vong-phan-4', 'Doom Patrol là loạt phim truyền hình web của Mỹ được tạo bởi Jeremy Carver cho DC Universe. Dựa trên nhóm siêu anh hùng cùng tên của DC Comics, bộ truyện có Jane, Rita Farr, Vic Stone, Larry Trainor, Cliff Steele, và Chief là thành viên của Doom Patrol. Lấy bối cảnh năm 2019, nhóm Doom Patrol - bao gồm Robotman, Negative Man, Elasti-Woman, Crazy Jane cùng thành viên mới Cyborg dưới sự dẫn dắt của Dr. Niles Caulder - nhận nhiệm vụ bảo vệ thế giới khỏi kẻ thù nguy hiểm tên là Mr. Nobody.', 1, 'https://img.ophim9.cc/uploads/movies/biet-doi-diet-vong-phan-4-thumb.jpg', 4, 'phimbo', 1, 15, 1, 0, 'Doom Patrol Season 4', 0, 0, '2023-12-17 22:49:28', '2023-12-17 22:50:37', '2022', 'Biệt Đội Diệt Vong (Phần 4), biet-doi-diet-vong-phan-4', NULL, '6tTM9nbRk5A', '12', 2654, NULL, 'Diane Guerrero, April Bowlby, Joivan Wade, Skye Roberts, Riley Shanahan, Matthew Zuk, Matt Bomer, Brendan Fraser, Michelle Gomez', 52),
(105, 'Khách Sạn Chôn Hồn', '75 phút', NULL, 'khach-san-chon-hon', 'Khách sạn chôn hồn, khach-san-chon-hon', 1, 'https://img.ophim9.cc/uploads/movies/khach-san-chon-hon-thumb.jpg', 5, 'phimle', 1, 3, 1, 0, 'Spirits Trapped in the Hotel', 0, 0, '2023-12-17 22:51:49', '2023-12-17 22:53:28', '2017', 'Khách sạn chôn hồn, khach-san-chon-hon', NULL, NULL, '1', 517, 'Zhang Zhong Liang', 'Selena', 74),
(106, 'Vầng Trăng Máu', '206 Phút', NULL, 'vang-trang-mau', 'Vào những năm 1920, các thành viên của khu tự trị Osage ở Mỹ bị ám sát một cách bí ẩn, làm dấy lên một cuộc điều tra lớn của FBI.', 1, 'https://img.ophim9.cc/uploads/movies/vang-trang-mau-thumb.jpg', 5, 'phimle', 2, 2, 1, 0, 'Killers of the Flower Moon', 0, 0, '2023-12-17 22:53:54', '2023-12-17 22:54:42', '2023', 'Vầng Trăng Máu, vang-trang-mau', NULL, 'EG0si5bSd6I', '1', 1736, 'Martin Scorsese', 'Leonardo DiCaprio, Robert De Niro, Lily Gladstone, Jesse Plemons, Tantoo Cardinal, John Lithgow, Brendan Fraser, Cara Jade Myers, JaNae Collins, Jillian Dion', 73),
(107, 'Trúng Tà', '89 Phút', NULL, 'trung-ta', 'Bộ phim diễn ra vào thời kỳ Trung Hoa Dân quốc, kể về Mục Nguyên đang đối diện với cái chết, trong trí óc, anh ta tự tưởng tượng ra một bản thân mới là cảnh sát Triệu Nhân. Khi Triệu Nhân khám phá ra sự thật đằng sau những sự việc chấn động kỳ quái, Mục Nguyên cũng hoàn thành sự cứu rỗi tâm hồn của mình trước khi qua đời. Với các tình tiết căng thẳng, câu chuyện kể về một câu chuyện triết học xoay quanh việc cứu rỗi tâm hồn. Nó nhằm mục đích truyền tải đến khán giả rằng chỉ có dũng cảm đối mặt với những sai lầm, đau khổ trong quá khứ, chúng ta mới có thể thực sự cởi bỏ những nút thắt bên trong, bước ra khỏi sương mù và giành lại cuộc sống mới.', 1, 'https://img.ophim9.cc/uploads/movies/trung-ta-thumb.jpg', 2, 'phimle', 3, 3, 1, 0, 'Headless', 0, 0, '2023-12-18 16:32:08', '2023-12-18 16:33:49', '2023', 'Trúng Tà, trung-ta', NULL, '2wtp09bvC0Q', '1', 1882, 'Ma Kai', 'Ken Chang, Li Qian', 17),
(108, 'Khu Rừng Kỳ Quái', '104 Phút', NULL, 'khu-rung-ky-quai', 'Mã Hoành Viễn dẫn mọi người vào khu vực cấm của núi Trường Bạch để tìm tàu hỏa, trên đường đi, Bắc Bá Thiên tham lam và ngu ngốc không muốn tuân theo quy tắc của rừng già, trong thời gian nghỉ ngơi, những con búp bê ma đã gây ra náo loạn trong trại. Trong khi chạy trốn, họ gặp một hang động dưới lòng đất, từng tên cướp bị hang động nuốt chửng, Miêu Nữ và Lão Hổ xuất hiện và đưa Mã Hoành Viễn và những người khác rời khỏi khu vực hang động nguy hiểm. Những người sống sót tiếp tục tiến vào làng Long Hưng và phát hiện ra rằng họ đang tổ chức tang lễ. Tên cướp La Cô đã nảy lòng tham, xúc phạm xác chết', 1, 'https://img.ophim9.cc/uploads/movies/khu-rung-ky-quai-thumb.jpg', 1, 'phimle', 1, 3, 1, 0, 'The Weird Forest', 0, 0, '2023-12-18 16:34:02', '2023-12-18 16:35:46', '2023', 'Khu Rừng Kỳ Quái, khu-rung-ky-quai', NULL, 'rvZnCLPVlKY', '1', 4826, 'Ren Ying Jian', 'Hsin Ai Lee, Mou Feng Bin, Wang Bao De, Wang Hong Qian, Mu Lan, Yang Han Bin, Sun Haoen', 10);
