(109, 'Nữ Hoàng Ve Sầu', '97 Phút', NULL, 'nu-hoang-ve-sau', 'Bị mắc kẹt ở Philippines trong Thế chiến thứ hai, một cô gái trẻ nhận ra rằng nhiệm vụ bảo vệ người mẹ đang hấp hối của mình rất phức tạp bởi niềm tin đặt nhầm chỗ vào một nàng tiên ăn thịt, lừa đảo.', 1, 'https://img.ophim9.cc/uploads/movies/nu-hoang-ve-sau-thumb.jpg', 1, 'phimle', 2, 13, 1, 0, 'In My Mother\'s Skin', 0, 0, '2023-12-18 16:36:19', '2023-12-18 16:37:07', '2023', 'Nữ Hoàng Ve Sầu, nu-hoang-ve-sau', NULL, 'GQclHcpbKdA', '1', 6721, 'Kenneth Lim Dagatan', 'Beauty Gonzalez, Felicity Kyle Napuli, Jasmine Curtis-Smith, James Mavie Estrella, Angeli Bayani, Arnold Reyes, Ronnie Lazaro, Brian Sy, Noel Sto. Domingo', 9),
