(111, 'Đấu Trường Hài Kịch', '28 phút/tập', NULL, 'dau-truong-hai-kich', 'Quy tụ trong cuộc cạnh tranh đầy khốc liệt để giành cơ hội dẫn một chương trình của Netflix, hai mươi cây hài đình đám nhất Hàn Quốc mang đến tiếng cười sảng khoái không ngớt.', 1, 'https://img.ophim9.cc/uploads/movies/dau-truong-hai-kich-thumb.jpg', 1, 'phimbo', 9, 11, 1, 0, 'Comedy Royale', 0, 0, '2023-12-18 16:41:53', '2023-12-18 16:43:14', '2023', 'Đấu trường hài kịch, dau-truong-hai-kich, Comedy Royale', NULL, 'K5l22oA5aUg&t=4s', '6', 664, NULL, 'Lee Kyung Kyu, Tak Jae Hoon, Moon Se Yun, Lee Yong Jin, Hwang Jae Seong, Lee Eun Ji, Lee Sang Jun, Kwak Beom, Lee Chang Ho, Eom Ji Yoon, Kim Du Young, Shin Gyu Jin, Choi Ji Yong, Na Sun Uk, Chung Young Joon, Kim Seung Jin, Lee Seon Min, Jo Hoon, Lee Jae Youl, Park Jin Ho', 8),
(112, 'Chú Mèo Thông Minh Hôm Nay Lại U Sầu', '23 phút/tập', NULL, 'chu-meo-thong-minh-hom-nay-lai-u-sau', 'Nhân viên văn phòng Saku nhận nuôi một con mèo đen đi lạc và gọi nó là Yukichi. Lạ kỳ thay, mèo ta dần to như một con gấu và trở thành người bạn cùng nhà hơn là thú cưng!', 1, 'https://img.ophim9.cc/uploads/movies/chu-meo-thong-minh-hom-nay-lai-u-sau-thumb.jpg', 1, 'phimbo', 9, 7, 1, 0, 'The Masterful Cat Is Depressed Again Today', 0, 0, '2023-12-18 16:43:30', '2023-12-18 16:45:07', '2023', 'Chú mèo thông minh hôm nay lại u sầu, chu-meo-thong-minh-hom-nay-lai-u-sau, The Masterful Cat Is Depressed Again Today', NULL, 'N-wI5EAhMyY', '13', 4460, NULL, 'Yasumoto Hiroki, Ishikawa Yui, Kakuma Ai, Konishi Katsuyuki, M・A・O, Irino Miyu, Taketatsu Ayana, Hikasa Yoko, Kubota Tamie, Sato Satomi, Fukuyama Jun, Inase Aoi, Taichi Kotoe', 6),
(113, 'Thần Ấn Vương Toạ', '20 phút/tập', NULL, 'than-an-vuong-toa', '6000 năm trước, hoàng đế Ma Thần Phong Tú và 72 Ma Thần Trụ giáng xuống, tất cả sinh vật bị nhiễm hơi thở của Ma Thần Trụ, lập tức biến thành Ma Vật, loài người bước vào thời đại đen tối. Sau đó, những kẻ mạnh của loài người đã lập thành Lục Đại Thánh Điện ngăn chặn Ma Vật, hình thành cục diện người và ma quỷ cùng tồn tại. Long Hạo Thiên một trong Lục Đại Thánh Điện, trở thành kỵ sĩ chỉ để cứu mẹ. Hạo Thiên từng bước trưởng thành, liên tiếp trải qua những cuộc gặp gỡ kỳ lạ, âm mưu quỷ kế, tình yêu và tình bạn định mệnh. Hạo Thiên tuân thủ tinh thần kỵ sĩ, nhận được sự công nhận của người khác nhờ vào nhân cách và sự nỗ lực của bản thân, cùng những nhân tài khác của Lục Đại Thánh Điện thành lập “Săn Ma Đoàn số 1” để đấu với Ma Vật, đấu tranh cho sự sống còn và tôn nghiêm của loài người.', 1, 'https://img.ophim9.cc/uploads/movies/than-an-vuong-toa-thumb.jpg', 4, 'phimbo', 1, 3, 1, 0, 'Throne of Seal', 0, 0, '2023-12-18 16:46:10', '2023-12-18 16:49:00', '2022', 'Thần Ấn Vương Toạ, than-an-vuong-toa, Throne of Seal', NULL, 'b5Hj8NlOKYI', '?', 4193, 'Đường Gia Tam Thiếu', NULL, 50),
