(120, 'Thế Giới Động Vật', '130 phút', NULL, 'the-gioi-dong-vat', 'Xui xẻo, nợ nần chồng chất, lại bị ép tham gia giải đấu sinh tử dựa trên trò \"oẳn tù tì\" do kẻ ác kiểm soát, liệu chàng trai trẻ có thể thoát thân nhờ khả năng toán học?', 1, 'https://img.ophim9.cc/uploads/movies/the-gioi-dong-vat-thumb.jpg', 5, 'phimle', 5, 3, 1, 0, 'Animal World', 0, 0, '2023-12-18 17:03:59', '2023-12-18 17:05:17', '2018', 'Thế giới động vật, the-gioi-dong-vat, Animal World', NULL, 'YaBE_RZL5Hg', '1', 2410, NULL, 'Lý Dịch Phong, Châu Đông Vũ, Michael Douglas', 69),
(122, 'Pony bé nhỏ: Tạo dấu ấn riêng (Phần 6)', '45 phút/tập', NULL, 'pony-be-nho-tao-dau-an-rieng-phan-6', 'Chào mừng trở lại với Equestria, nơi phép thuật pony xuất hiện ở mọi nơi. Có hội bạn Zipp, Sunny, Izzy, Pipp và Hitch dẫn đường, hãy cùng dấn thân vào cuộc phiêu lưu!', 1, 'https://img.ophim9.cc/uploads/movies/pony-be-nho-tao-dau-an-rieng-phan-6-thumb.jpg', 5, 'phimle', 22, 15, 1, 0, 'My Little Pony: Make Your Mark (Season 6)', 0, 0, '2023-12-18 17:09:08', '2023-12-18 17:09:08', NULL, 'Pony bé nhỏ: Tạo dấu ấn riêng (Phần 6), pony-be-nho-tao-dau-an-rieng-phan-6, My Little Pony: Make Your Mark (Season 6)', NULL, '', '4', 6391, '', 'Jenna Warren, Maitreyi Ramakrishnan, JJ Gerber, Ana Sani, Aj Bridel, Rob Tinkler, Bahia Watson, Athena Karkanis', 68),
(124, 'Lời Nguyền Của Vật Tổ', '89 phút', NULL, 'loi-nguyen-cua-vat-to', 'Chuyến thám hiểm tới khu mai táng lịch sử có bước ngoặt kinh hoàng khi nhóm phát hiện những bí mật đằng sau một truyền thống ghê rợn.', 1, 'https://img.ophim9.cc/uploads/movies/loi-nguyen-cua-vat-to-thumb.jpg', 1, 'phimle', 3, 16, 1, 0, 'Curse of the Totem', 0, 0, '2023-12-18 17:12:36', '2023-12-18 17:14:32', '2023', 'Lời nguyền của vật tổ, loi-nguyen-cua-vat-to, Curse of the Totem', NULL, '2_ZzZ2-8Pcc', '1', 494, 'Jason Chong', 'Bront Palarae, Uqasha Senrose, Mohd Syafie Naswip, Amerul Affendi, Daiyan Trisha', 0),
(125, 'Thợ Săn Thành Phố', '100 phút', NULL, 'tho-san-thanh-pho', 'Một điều tra viên tư nhân tự mãn có thể lướt trên một con tàu du lịch đầy những khách hàng quen giàu có, phụ nữ lộng lẫy, những kẻ khủng bố giết người và thực phẩm khan hiếm.', 1, 'tho-san-thanh-pho-thumb1622.avif', 5, 'phimle', 2, 14, 1, 0, 'City Hunter', 0, 0, '2023-12-18 17:37:24', '2023-12-18 17:38:45', '1995', 'THỢ SĂN THÀNH PHỐ, tho-san-thanh-pho, City Hunter', NULL, '9Iy7-3AIA14', '1', 1015, 'WangJing', 'Jackie Chan, Joey Wang, Chingmy Yau, KUMIKO GOTO, Leon.Lai Ming, Richard Norton, Jan Lamb, Gary Daniels, Gary Edward Daniels, Bruce Lee, Wendee Lee, Ming-Sing Wong, Hoi Mang, Harrison, Meng Hoi, Man Hei, Kareem Abdul-Jabbar, Michael Wong', 67),
(127, 'Thám Tử Lừng Danh Conan 26: Tàu Ngầm Sắt Màu Đen', '110 Phút', NULL, 'tham-tu-lung-danh-conan-26-tau-ngam-sat-mau-den', 'Địa điểm lần này được đặt ở vùng biển gần đảo Hachijo-jima, Tokyo. Các kỹ sư từ khắp nơi trên thế giới đã tập hợp để vận hành toàn diện \"Phao Thái Bình Dương\", một cơ sở ngoài khơi để kết nối các camera an ninh thuộc sở hữu của lực lượng cảnh sát trên toàn thế giới. Một thử nghiệm về một \"công nghệ mới\" nhất định dựa trên hệ thống nhận dạng khuôn mặt đang được tiến hành ở đó. Trong khi đó, Conan và Đội thám tử nhí đến thăm Hachijo-jima theo lời mời của Sonoko và nhận được một cuộc điện thoại từ Subaru Okiya thông báo rằng một nhân viên Europol đã bị sát hại ở Đức bởi Jin của Tổ chức Áo đen. Conan lo lắng, lẻn vào cơ sở và phát hiện ra rằng một nữ kỹ sư đã bị Tổ chức Áo đen bắt cóc...! Hơn nữa, một ổ USB chứa một số thông tin nhất định mà cô ấy sở hữu lại lọt vào tay tổ chức... Một bóng đen cũng len lỏi vào Ai Haibara..', 1, 'https://img.ophim9.cc/uploads/movies/tham-tu-lung-danh-conan-26-tau-ngam-sat-mau-den-thumb.jpg', 1, 'phimle', 2, 7, 1, 0, 'Detective Conan: Black Iron Submarine', 1, 0, '2023-12-28 09:48:32', '2023-12-28 09:51:16', '2023', 'Thám Tử Lừng Danh Conan 26: Tàu Ngầm Sắt Màu Đen, tham-tu-lung-danh-conan-26-tau-ngam-sat-mau-den, Detective Conan: Black Iron Submarine', 0, 'NwnQI9izPFc', '1', 2395, 'Yuzuru Tachikawa', 'Minami Takayama, Wakana Yamazaki, Rikiya Koyama, Megumi Hayashibara, Shuichi Ikeda, Kazuhiko Inoue, Kenichi Ogata, Atsuko Yuya, Yukimasa Kishino, Yukitoshi Hori', NULL),
(128, 'Rick Và Morty', '22 phút/tập', NULL, 'rick-va-morty', 'Rick, nhà khoa học siêu phàm nhưng hay say xỉn, kéo theo Morty – đứa cháu trai tuổi teen hay cáu kỉnh – phiêu lưu trong các thế giới và chiều không gian khác nhau.', 1, 'https://img.ophim9.cc/uploads/movies/rick-va-morty-phan-5-thumb.jpg', 4, 'phimbo', 1, 2, 1, 0, 'Rick and Morty', 0, 5, '2023-12-28 09:52:20', '2023-12-28 10:06:49', '2021', 'Rick Và Morty (Phần 5), rick-va-morty-phan-5, Rick and Morty Season 5', 2, 'WNhH00OIPP0', '10', 3595, NULL, 'Chris Parnell, Spencer Grammer, Sarah Chalke, Ian Cardoni, Harry Belden', NULL),
(129, 'Thiếu Niên Và Chim Diệc', '124 Phút', NULL, 'thieu-nien-va-chim-diec', 'Đến từ Studio Ghibli và đạo diễn Miyazaki Hayao, bộ phim là câu chuyện về hành trình kỳ diệu của cậu thiếu niên Mahito trong một thế giới hoàn toàn mới lạ. Trải qua nỗi đau mất mẹ cùng mối quan hệ chẳng mấy vui vẻ với gia đình cũng như bạn học, Mahito dần cô lập bản thân... cho đến khi cậu gặp một chú chim diệc biết nói kỳ lạ. Mahito cùng chim diệc bước vào một tòa tháp bí ẩn, nơi một thế giới thần kỳ mở ra, đưa cậu gặp gỡ những người mình yêu thương... trong một nhân dạng hoàn toàn khác.', 1, 'https://img.ophim9.cc/uploads/movies/thieu-nien-va-chim-diec-thumb.jpg', 5, 'phimle', 1, 7, 1, 0, 'The Boy and the Heron', 0, 0, '2023-12-28 10:04:05', '2023-12-28 10:05:09', '2023', 'Thiếu Niên Và Chim Diệc, thieu-nien-va-chim-diec, The Boy and the Heron', 1, 't5khm-VjEu4', '1', 3361, 'Hayao Miyazaki', 'Soma Santoki, Masaki Suda, Ko Shibasaki, Yoshino Kimura, Takuya Kimura, Keiko Takeshita, Jun Fubuki, Sawako Agawa, Karen Takizawa, Shinobu Otake', NULL),
(130, 'Quái Vật Kinh Dị', '105 phút', NULL, 'quai-vat-kinh-di', 'Tại một vùng nghiên cứu tại Nam Cực, sự phát hiện về một sinh vật ngoài hành tinh đã dẫn đến sự đối đầu giữa cô sinh viên Kate Lloyd và nhà khoa học Sander Halvorson. Trong khi Dr.Halvorson vẫn tiếp tục nghiên cứu thì Kate cùng với Sam Carter, một phi công lái trực thăng hợp lại thành một nhóm để chiến đấu với loài sinh vật ngoài hành tinh kỳ quái có khả năng mượn cơ thể của người khác...', 1, 'quai-vat-kinh-di-thumb1434.avif', 3, 'phimle', 2, 2, 1, 0, 'The Thing', 1, 0, '2023-12-28 22:14:02', '2023-12-28 22:14:02', '2011', 'quai-vat-kinh-di, Quái Vật Kinh Dị, The Thing', 1, 'Txjm94GnrPA', '1', 69, 'Matthijs van Heijningen Jr.', 'Mary Elizabeth Winstead, Joel Edgerton, Ulrich Thomsen', NULL),
(131, 'Phía Tây: Vương Quốc Bóng Đá', '75 phút', NULL, 'phia-tay-vuong-quoc-bong-da', 'The Westward: Shadow City\" kể câu chuyện rằng để điều khiển Tang Sanzang chiếm lấy ngọn lửa vĩnh cửu, Moying, chúa tể của Thành phố bóng tối, đã sử dụng khả năng của thành phố ma thuật để thỏa mãn mọi ham muốn để thu hút trái tim quỷ của Tang Sanzang. Cuối cùng, Tang Sanzang đã vượt qua những con quỷ bên trong mình và thức tỉnh trở lại, anh và những người học trò của mình hợp sức để đánh bại Moying, giải thể thành phố tà ác vốn là phe ác và lại bắt tay vào hành trình cứu rỗi những người dân bình thường trên thế giới.', 1, 'the-westward-the-kingdom-of-shadow-thumb7211.avif', 3, 'phimle', 2, 3, 1, 0, 'The Westward: The Kingdom of Shadow', 1, 0, '2023-12-28 22:20:06', '2023-12-28 22:20:06', '2023', 'phia-tay-vuong-quoc-bong-da, Phía Tây: Vương Quốc Bóng Đá, The Westward: The Kingdom of Shadow', NULL, 'YtHhvc8EDFo', '1', 2208, 'Zhong Mulong', NULL, NULL),
(132, 'Yêu Nhầm Bạn Thân', '120 phút', NULL, 'yeu-nham-ban-than', 'Phim Friend Zone (Yêu Nhầm Bạn Thân): xoay quanh mối tình đơn phương của Palm – một tiếp viên hàng không. Ngay từ lúc còn ngồi trên ghế nhà trường, anh đã thầm yêu Gink, nhưng sau đó, quyết định giữ tình bạn thân thiết. 10 năm trôi qua, cả hai trưởng thành và vẫn giữ mối quan hệ bạn thân khác giới, những khi bên nào có trục trặc với người yêu, thì đều có bên kia xuất hiện làm “phao cứu sinh”.', 1, 'yeu-nham-ban-than-thumb2922.avif', 3, 'phimle', 4, 6, 1, 0, 'Friend Zone', 1, 0, '2023-12-28 22:24:34', '2023-12-28 22:24:34', '2019', 'Yêu Nhầm Bạn Thân, Friend Zone, yeu-nham-ban-than', NULL, 'i8X2hXPd1XU', '1', 688, 'Chayanop Bunprakop', 'Naphat Siangsomboon, Jason Young, Pimchanok Leuwisetpaiboon', NULL),
(133, 'Minion Cắt Cỏ', '78 phút', NULL, 'minion-cat-co', 'Phim Minion Cắt Cỏ - Mower Minions 2016: Tập phim ngắn về những chú Minion đang cắt cỏ.', 1, 'minion-cat-co-thumb2802.avif', 3, 'phimle', 1, 2, 1, 0, 'Mower Minions', 1, 0, '2023-12-28 22:28:23', '2023-12-28 22:28:23', '2016', 'Minion Cắt Cỏ, Mower Minions, minion-cat-co', NULL, '_Mgt_B1zv6o', '1', 2906, 'Bruno Chauffard, Glenn McCoy', 'Pierre Coffin, Dave Rosenbaum, Jody Gelb', NULL),
(134, 'Tiểu Quái Da Vàng', '93 phút', NULL, 'tieu-quai-da-vang', 'Minions là bộ phim hoạt hình hài Mỹ 2015 của Kyle Balda, Pierre Coffin. Bộ phim đưa ta quay về thưở khai thiên lập địa, khi ấy Minion đã tồn tại. Chúng luôn phục tùng cho những kẻ tàn ác nhất nhưng họ cũng lần lượt ra đi. Vì ko còn ai để phụng sự, Minion tên Kevin đã cùng Stuart và Bob ra đi khám phá thế giới và tìm kiếm chủ nhân tàn ác cho mình. Và chúng đã tìm ra Scarlet Overkill - nữ siêu ác nhân đầu tiên nhân loại. Rồi chuyện gì sẽ xảy ra tiếp theo? Trái đất sẽ như thế nào?', 1, 'tieu-quai-da-vang-thumb7505.avif', 3, 'phimle', 1, 2, 1, 0, 'Minions', 1, 0, '2023-12-28 22:40:31', '2023-12-28 22:40:31', '2015', 'Tiểu Quái Da Vàng, Minions, tieu-quai-da-vang', 2, 'eisKxhjBnZ0', '1', 5446, 'Kyle Balda, Pierre Coffin', 'Chris Renaud, Pierre Coffin, Sandra Bullock', NULL),
(135, 'Giấc Mộng Tây Du 3: Kỳ Ngộ Nữ Nhi Quốc', '107 phút', NULL, 'giac-mong-tay-du-3-ky-ngo-nu-nhi-quoc', 'Phim Giấc Mộng Tây Du 3: Kỳ Ngộ Nữ Nhi Quốc Học sinh diệp mặc mặc ban đêm xông vào cấm địa, cơ duyên xảo hợp hồi tưởng lại trí nhớ kiếp trước của mình. Kiếp trước của nàng là quốc vương nữ nhi quốc Dạ Tịch Mặc, Khi nữ nhi quốc bị diệt quốc, Lão tướng bắc minh công trói hồn phách các nàng vào trong người bù nhìn trở thành nhiếp hồn tộc, từ nay về sau không thể tiến vào luân hồi, chỉ có thể dựa vào hấp thu hồn phách của đàn ông để sống tiếp... Câu chuyện xảy ra khi đoàn người Đường tăng qua nữ nhi quốc.', 1, 'giac-mong-tay-du-3-ky-ngo-nu-nhi-quoc-thumb1989.avif', 3, 'phimle', 4, 3, 1, 0, 'The Dream Journey 3', 0, 0, '2023-12-28 22:44:03', '2023-12-28 22:44:54', '2017', 'The Dream Journey 3, giac-mong-tay-du-3-ky-ngo-nu-nhi-quoc, Giấc Mộng Tây Du 3: Kỳ Ngộ Nữ Nhi Quốc', NULL, '4S3rGVgB5Y0', '1', 6239, 'Mã Vân', 'Hứa Minh Hổ, Phiền Nhị, Trương Thiên Kỳ', NULL),
(137, 'Cô Nàng Mạnh Mẽ Gang Nam Soon', '70 phút/tập', NULL, 'co-nang-manh-me-gang-nam-soon', 'Được ban cho sức mạnh siêu phàm, người phụ nữ trẻ nọ trở về Hàn Quốc để tìm gia đình ruột nhưng lại vướng vào vụ án ma túy có thể thử thách sức mạnh của cô.', 1, 'https://img.ophim9.cc/uploads/movies/co-nang-manh-me-gang-nam-soon-thumb.jpg', 1, 'phimle', 1, 11, 1, 0, 'Strong Girl Nam-soon', 0, 0, '2023-12-28 22:49:41', '2023-12-28 22:51:15', '2023', 'Cô nàng mạnh mẽ Gang Nam Soon, co-nang-manh-me-gang-nam-soon, Strong Girl Nam-soon', NULL, 'bPnfXlsedvc', '16', 4074, NULL, 'Lee You Mi, Kim Jung Eun, Kim Hae Sook, Ong Seong Wu, Byeon Woo Seok', NULL),
(138, 'Phiền Anh Tỏ Tình Trước Nhé', '10 phút/tập', NULL, 'phien-anh-to-tinh-truoc-nhe', 'Chuyện kể về Lâm Thần, một nghiên cứu sinh học viện Y. Để giúp đỡ chị gái Lâm Vãn, một nghệ sĩ không mấy tiếng tăm đang bị hôn mê có thể giữ được công việc, cô đã xuất hiện dưới thân phận của chị mình. Trùng hợp sao lại gặp chàng trai Lục Tuân mình thầm mến hồi còn đi học, sau đó là câu chuyện tiếp nối mối duyên xưa…', 1, 'https://img.ophim9.cc/uploads/movies/phien-anh-to-tinh-truoc-nhe-thumb.jpg', 1, 'phimle', 1, 3, 1, 0, 'Confess Your Love', 0, 0, '2023-12-28 22:51:43', '2023-12-28 22:52:28', '2023', 'Phiền Anh Tỏ Tình Trước Nhé, phien-anh-to-tinh-truoc-nhe, Confess Your Love', NULL, 'VKJAUlX8nqQ', '24', 4375, 'An Dong', 'Pornnappan Pornpenpipat, Song Jiyang, Dong Yan, Zhang Yongbo, 赵帅, 刘亚锟', NULL),
(139, 'Chú Thỏ Nhung', '44 Phút', NULL, 'chu-tho-nhung', 'Với cậu bé William bảy tuổi thì món quà Giáng Sinh mà cậu nhận được không chỉ là một món đồ chơi yêu thích, mà còn là người bạn tri kỷ và chìa khóa mở ra một thế giới đầy màu nhiệm.', 1, 'https://img.ophim9.cc/uploads/movies/chu-tho-nhung-thumb.jpg', 1, 'phimle', 1, 12, 1, 0, 'The Velveteen Rabbit', 0, 0, '2023-12-28 22:52:38', '2023-12-28 22:54:26', '2023', 'Chú Thỏ Nhung, chu-tho-nhung, The Velveteen Rabbit', 2, '49R6Ri6oV3E', '1', 339, 'Jennifer Perrott', 'Phoenix Laroche, Ellie Mejia, Samantha Colley, Leonard Buckley, Conor Hamill, Paul Sparkes, Tilly Vosburgh, Kiefer Moriarty, Elizabeth O\'Toole, Alex Lawther', NULL),
(140, 'Bếp Trưởng Tạm Quyền', '32 phút/tập', NULL, 'bep-truong-tam-quyen', 'Khi bếp trưởng bị hôn mê, người bếp phó tận tâm của ông phải giữ cho nhà hàng ẩm thực cao cấp Philippines của họ không bị đóng cửa.', 1, 'https://img.ophim9.cc/uploads/movies/bep-truong-tam-quyen-thumb.jpg', 1, 'phimle', 1, 17, 1, 0, 'Replacing Chef Chico', 0, 0, '2023-12-28 22:54:44', '2023-12-28 22:56:21', '2023', 'Bếp trưởng tạm quyền, bep-truong-tam-quyen, Replacing Chef Chico', NULL, 'Jc-1JERI_ak', '8', 2853, 'Dan Villegas', 'Alessandra de Rossi, Piolo Pascual, Sam Milby, Joel Saracho, Yesh Anne Burce, Angie Castrence, Paulo Angeles, DMs Boongaling', NULL),
(142, '3 Kẻ Trốn Tù', '107 Phút', NULL, '3-ke-tron-tu', 'Chúng ta sẽ làm quen với Everett ba hoa bốc phét lúc nào cũng bóng mượt, Delmar yếu đuối luôn tuềnh toàng và Pete cao kều tính tình đơ đơ. Cả ba bị xích chung trong một chiếc xiềng sắt khiến họ không thể chạy nhanh, chưa kể bộ quần áo tù nhân sẽ tố cáo thân phận họ. Để phá vỡ gông cùm và thay trang phục, Pete rủ bạn tù về nhà anh họ Wash nhưng vì món tiền thưởng, cả ba đã bị chính gã anh họ bán đứng. Để trả đũa bộ ba chôm luôn xe của nhà Wash cho cuộc hành trình phía trước.Trên đường đi họ gặp gỡ nhiều người bạn mới. Đầu tiên là anh chàng da đen Tommy có tài đánh đàn, hợp lại với nhau, bộ tứ tạo thành ban nhạc The Soggy Bottom Boys (Những chàng trai ướt mông). Chia tay với Tommy, nhóm tù nhân tiếp tục trở thành đồng phạm ...', 1, 'https://img.ophim9.cc/uploads/movies/3-ke-tron-tu-thumb.jpg', 5, 'phimle', 2, 2, 1, 0, 'O Brother, Where Art Thou?', 0, 0, '2023-12-28 22:58:03', '2023-12-28 22:58:57', NULL, '3 Kẻ Trốn Tù, 3-ke-tron-tu, O Brother, Where Art Thou?', NULL, 'G7nNDKrTrag', '1', 6550, 'Joel Coen, Ethan Coen', 'George Clooney, John Turturro, Tim Blake Nelson, Charles Durning, John Goodman, Michael Badalucco, Holly Hunter, Stephen Root, Chris Thomas King, Wayne Duvall', NULL),
(143, 'Tân Thiếu Lâm Tự - Shaolin', '131 Phút', NULL, 'tan-thieu-lam-tu-shaolin', 'Phim xoay quanh nhân vật tướng quân do Lưu Đức Hoa thủ diễn. Nhân vật của Lưu Đức Hoa bị người phụ tá (Tạ Đình Phong thủ vai) hãm hại, còn vợ anh (Phạm Băng Băng) thì bỏ đi, mang theo cô con gái nhỏ của hai người. Quá tuyệt vọng, nhân vật của Lưu Đức Hoa bỏ tới chùa Thiếu Lâm sinh sống và từ đó học đạo Phật do một nhà sư phụ trách việc bếp núc trong chùa (Thành Long). Viên đại tướng sau đó cũng đi tu và dẫn dắt các tăng nhân trong Thiếu Lâm Tự chống lại tay phụ tá ngày nào để bảo vệ ngôi chùa cùng các cư dân sống trong vùng.', 1, 'https://img.ophim9.cc/uploads/movies/tan-thieu-lam-tu-shaolin-thumb.jpg', 5, 'phimle', 1, 14, 1, 0, 'Shaolin', 0, 0, '2023-12-28 22:59:10', '2023-12-28 23:00:00', '2011', 'Tân Thiếu Lâm Tự - Shaolin, tan-thieu-lam-tu-shaolin, Shaolin', NULL, 'HUF8_EhO6vU', '1', 5948, 'Benny Chan', 'Andy Lau, Nicholas Tse, Fan Bingbing, Jackie Chan, Wu Jing, Yu Shaoqun, Xing Yu, Hai Yu, Xinxin Xiong, Bai Bing', NULL),
(144, 'Tứ Yêu Quan Kì Án', '79 Phút', NULL, 'tu-yeu-quan-ki-an', 'Giai đoạn cuối triều nhà Thanh, đầu thời kì Trung Hoa Dân Quốc, cuộc sống người dân đầy biến động và bất ổn. Những băng đảng tội phạm và quân chủ thống trị hoành hành. Tại thị trấn nhỏ phía Tây Bắc có tên là Cửu Hà, đã xảy ra hàng loạt vụ án bí ẩn, nhiều nạn nhân chết rất kỳ quái với những dấu vết không rõ ràng, giống như đã bị sức mạnh ma quỷ hại chết. Mọi người trong thị trấn đều rất hoảng sợ và lo lắng, cảm thấy mình có thể trở thành nạn nhân tiếp theo. Nữ thám tử Thất Hỉ của quận chịu trách nhiệm điều tra chuyên sâu về những vụ án này và bất ngờ tìm thấy một loại bột màu đỏ trên thi thể nạn nhân và tại hiện trường vụ án mạng, còn gọi là Cổ Mê Tử - loại bột được sử dụng trong thế giới của những pháp sư. Để tìm ra bằng chứng, họ đã đến tìm đến pháp sư nổi tiếng đến từ vùng sâu Tây Bắc -Tân Thập Tứ để giúp họ làm sáng tỏ vụ án. Trong quá trình điều tra họ cũng Bạch Tiểu Bạch một pháp sư trẻ tuổi với thân phận bí ẩn cũng đang bí mật điều tra về vụ án này. V ', 1, 'https://img.ophim9.cc/uploads/movies/tu-yeu-quan-ki-an-thumb.jpg', 1, 'phimle', 1, 3, 1, 0, 'The Case of the Four Demon Coffins', 0, 0, '2023-12-28 23:00:20', '2023-12-28 23:01:21', '2023', 'Tứ Yêu Quan Kì Án, tu-yeu-quan-ki-an, The Case of the Four Demon Coffins', NULL, NULL, '1', 2619, 'Guan Dongjie', 'Gong Xiaojun, Zeng Chen, Wu Chunyi, Yuen Cheung-Yan, Chu Xiaolong, 舒杨', NULL),
(145, 'Trường An Ba Vạn Dặm', '168 Phút', NULL, 'truong-an-ba-van-dam', 'Lấy bối cảnh Trung Quốc thời nhà Đường, vài năm sau khi Loạn An Sử do An Lộc Sơn đứng đầu nổ ra. Đồng Quan bại trận, Cao Thích buộc phải rút quân trốn chạy khiến cho Trường An rơi vào thế khó, vua Đường Huyền Tông rời bỏ kinh đô. Trong bối cảnh lịch sử đầy khắc nghiệt đó, tình bạn giữa Cao Thích và Lý Bạch trở thành một giai thoại đáng để ngưỡng mộ và ca ngợi. ', 1, 'https://img.ophim9.cc/uploads/movies/truong-an-ba-van-dam-thumb.jpg', 1, 'phimle', 5, 3, 1, 0, 'Chang An', 0, 0, '2023-12-28 23:01:31', '2023-12-28 23:02:09', '2023', 'Trường An Ba Vạn Dặm, truong-an-ba-van-dam, Chang An', NULL, NULL, '1', 4421, 'Xie Junwei, Zou Jing', 'Yang Tianxiang, Zhenhe Ling, Junquan Wu, Xuan Xiaoming, Lu Lifeng, Sun Lulu', NULL),
(146, 'Paul, Sứ Đồ Của Chúa Kito', '107 phút', NULL, 'paul-su-do-cua-chua-kito', 'Trước lúc bị xử tử, tông đồ Paul đã rao giảng lời của Chúa còn bạn ông, Luke, đã viết một cuốn sách có tính cách mạng dẫn đến sự ra đời của giáo hội.', 1, 'https://img.ophim9.cc/uploads/movies/paul-su-do-cua-chua-kito-thumb.jpg', 1, 'phimbo', 1, 2, 1, 0, 'Paul, Apostle of Christ', 0, 0, '2023-12-28 23:02:21', '2023-12-28 23:03:16', '2018', 'Paul, sứ đồ của chúa Kito, paul-su-do-cua-chua-kito, Paul, Apostle of Christ', NULL, NULL, '1', 5843, NULL, 'James Faulkner, Jim Caviezel, Olivier Martinez', NULL),
(147, 'Quỷ Lùn Tinh Nghịch: Đồng Tâm Hiệp Nhạc', '92 Phút', NULL, 'quy-lun-tinh-nghich-dong-tam-hiep-nhac', 'Khi anh trai của Branch, Floyd, bị bắt cóc vì tài năng âm nhạc của anh ấy bởi một cặp nhân vật phản diện ngôi sao nhạc pop bất chính, Branch và Poppy bắt đầu một hành trình đau khổ và đầy cảm xúc để đoàn tụ những người anh em khác và giải cứu Floyd khỏi một số phận thậm chí còn tồi tệ hơn cả sự mù mờ của văn hóa đại chúng. .', 1, 'https://img.ophim9.cc/uploads/movies/quy-lun-tinh-nghich-dong-tam-hiep-nhac-thumb.jpg', 5, 'phimle', 1, 2, 1, 0, 'Trolls Band Together', 0, 0, '2023-12-28 23:03:33', '2023-12-28 23:04:10', '2023', 'Quỷ Lùn Tinh Nghịch: Đồng Tâm Hiệp Nhạc, quy-lun-tinh-nghich-dong-tam-hiep-nhac, Trolls Band Together', NULL, 'qZ40Z62tcXM', '1', 2438, 'Walt Dohrn', 'Anna Kendrick, Justin Timberlake, Eric André, Kid Cudi, Daveed Diggs, Troye Sivan, Camila Cabello, Amy Schumer, Andrew Rannells, RuPaul', NULL);
